	(1091,'UniversoPet','000000000000','contato@universopet.net','www.universopet.net','Divisão de negócios da Strela Distribuidora, empresa com mais de 20 anos de experiência no mercado Pet, a Universo Pet é uma distribuidora que atua exclusivamente com produtos e acessórios para o mercado Pet (animais de estimação).\r\n\r\nSediada na cidade de Franca, interior de São Paulo, a empresa ocupa um espaço de 4 mil m² , sendo 2 mil de área construída, são aproximadamente 90 fornecedores e um mix que ultrapassa os 4.000 itens.\r\n\r\nAlém de distribuir produtos das melhores marcas do mercado, a Universo Pet detém a marca própria Brincalhão, que produz excelentes produtos, tais como: camas, colchonetes, produtos de higiene e beleza, areias para gatos, tapetes higiênicos, entre outros.\r\n\r\nA equipe é composta por representantes altamente qualificados, que são responsáveis por atender aproximadamente 150 cidades de nossa área de atuação, que inclui as regiões de Ribeirão Preto, Franca, São Carlos, Araraquara, São José do Rio Preto e o Triângulo Mineiro.\r\n\r\nA Universo Pet distribui e produz produtos com qualidade, tendo como diferencial no mercado a qualidade no atendimento, agilidade na entrega, variedade de produtos e preços competitivos.\r\n\r\nSeu principal objetivo é atender às necessidades dos clientes, com profissionalismo e transparência, a fim de que a parceria seja consistente e duradoura.','https://www.facebook.com/universopet.net','https://twitter.com/UniversoPetBr','Tristão de Almeida, 6300','Distrito Industrial',610,20,'200.233.168.30','N','0800-7245353','','2014-06-24 14:47:34',NULL,NULL),
