inistração de Banco de Dados;\r\n• Configuração de Estações de Trabalho e Servidores;\r\n• Consolidação e Migração de Servidores / Sistemas Operacionais;\r\n• Instalação de Correios Eletrônicos e Serviços de Rede;\r\n• Instalação e Configuração de Ativos de Rede;\r\n• Instalação e Configuração de Gateway, Firewall e VPN;\r\n• Virtualização de Servidores;\r\n• Integração de Servidores e Desktops.\r\n• Infra-Estrutura e Cabeamento Estruturado Par Metálico, Categorias 5 e 6.\r\n• CFTV\r\n• Entre outros','','','RUA ALICE ALÉM SAADI, 855 - SL-2004','NOVA RIBEIRÃNIA',1026,10,'177.94.1.230','S','(16) 3235-0981','','2015-01-09 16:30:01',NULL,NULL),
