	(1780,'Fazenda Vila Imperial','19.382.437/0001-65','gisa.lopes@canalexecutivo.com','http://www.fazendavilaimperial.com.br/#','Há apenas 50 km de Belo Horizonte, a Fazenda Vila Imperial é o espaço de recepções mais atrativo da região. Nossa proposta é causar uma experiência de bem estar e contato com a natureza, através de um cenário único de montanhas, ar puro, lagoas, trilhas ecológicas e vistas panorâmicas. Tudo para deixar o dia do seu evento ainda mais especial.\r\nNosso espaço conta com 250.000 m² divididos entre área verde (campo, pomar, horta), piscina, churrasqueira, casa de suporte e sala de eventos corporativos.\r\nA fazenda também conta com estacionamento privativo, monitoramento de segurança 24 horas, além de um atendimento totalmente personalizado.\r\nVila imperial é resultado de um projeto que alia vida saudável, sustentabilidade e preservação ambiental.\r\nNossa equipe terá prazer em recebê-los no Vila Imperial.','https://www.facebook.com/fazendavilaimperial?fref=ts','','BR 262, KM 381','Zona Rural',4010,13,'191.185.46.221','N','31 3564-5002','','2015-01-19 18:15:09',NULL,NULL),
