	(1845,'Ótica Emanuelle','10.955.634.0001-51','acceleraoticaemanuelle@gmail.com','http://www.oticaemanuelle.com.br/','A Ótica Emanuelle foi fundada em 1984 e está sediada na cidade do Recife em Pernambuco, onde hoje conta com duas lojas.\r\n  \r\nA Ótica Emanuelle é uma empresa familiar e nosso lema é:  “Satisfação em atender bem”, pois fazemos disso nosso diferencial. Oferecemos aos clientes um produto com qualidade e preço baixo, além de um atendimento e um pós-venda sem igual.\r\n  \r\nTrabalhamos com os melhores fornecedores de lentes e armações nacionais, além de lentes de contato e linha solar.\r\n  \r\nCom a preocupação em desenvolver um trabalho sustentável, sempre buscamos melhorar através de cursos e palestras oferecidos aos nossos colaboradores a fim de oferecer um excelente serviço.\r\n  \r\nNossas lojas foram reformadas em Março de 2014 e remodelamos totalmente o conceito de atendimento ao cliente, nos preocupando com questões como iluminação, aproveitamento de espaço, apresentação dos produtos, etc.\r\n  \r\nNosso objetivo é crescer cada vez mais, adquirindo o reconhecimento dos nossos clientes e captando novos a cada ano. Venha nos conhecer !','https://www.facebook.com/oticaemanuelle?ref=stream&fref=nf','','Rua Camboa do Carmo, 118','Santo Antônio',6662,24,'179.183.91.251','S','(81)3424-9700','','2015-02-09 11:31:36',NULL,NULL),
