\n\r\nAtendemos a nível Brasil.\r\n\r\nElaine P. Jesus\r\nPromotora de Transportes - Filial RIO\r\nelaine.jesus@speedpak.com.br\r\nFixo: 21 2590-8011 / 3882-1380  RAMAL 208\r\nCelular: 21 9 9498-5962 / WhatsApp: 21 9 9498-5962\r\n','','','Rua Aguiar Moreira, 244','Bonsucesso',237,2,'201.36.144.114','S','21994985962','','2015-02-20 15:59:23',NULL,NULL),
