	(2031,'TIME DOS SALGADOS','','contato@timedossalgados.com.br','www.timedossalgados.com.br','Nosso time surgiu da necessidade de encontrarmos salgados gostosos e de qualidade para festinhas e reuniões em casa. Sempre que encomendávamos com outras empresas os salgados eram ruins, praticamente não tinham receio, eram muito oleosos. E foi ai que começamos então a fazermos nossos próprios salgados.  E o sucesso foi tanto que os amigos e familiares começaram a nos pedir para que fizéssemos também para eles. Após tantos pedidos, tivemos a ideia de montarmos a empresa Time dos Salgados. \r\n   Não gostamos de nos referir ao Time dos Salgados como empresa, e sim como um TIME, pois cada um que faz um pedido conosco transforma-se num integrante, geralmente o técnico, que monta sua própria escalação de acordo com seu gosto.\r\n \r\n   Nossos salgados são feitos com uma deliciosa e tradicional massa de batata, muito bem recheados e ficam sempre sequinhos após a fritura. Além disso temos uma deliciosa opção de sobremesa, que são os mini churros recheados de doce de leite.\r\n \r\nEntre você também para o Time!!!','https://www.facebook.com/timedossalgados','','','Tucuruvi',1134,13,'187.33.44.90','N','(11) 2242-8526 / 99327-2740 / 99493-0491','','2015-04-14 12:34:46',NULL,NULL),
