	(2081,'Saturno Brindes','05602379000123','arte@saturnobrindes.com.br','www.saturnobrindes.com.br','Dotada de ampla experiência em produtos da mais alta qualidade para o ramo de brindes para empresas.\r\n\r\nA Saturno Brindes se dedica à fabricação e comercialização de brindes desde 1978.\r\n \r\n \r\nFabricamos os mais variados brindes personalizados, como: espelhos de bolsa, canecas, bolas de futebol, baldes de gelo, cooler para 10 latas, entre outros.\r\n\r\n	\r\nAs bolas personalizadas são os destaques para todas as idades e podem ser encontradas nos modelos de futebol e vôlei, além da linha de bolinhas anti stress esportiva.\r\n\r\nTodos os nossos produtos são preparados com os mais avançados recursos tecnológicos, sempre visando qualidade e satisfação dos clientes e consumidores em todo o Brasil.\r\n \r\nTemos representantes nas principais capitais brasileiras, agilizando ainda mais nossos prazos de entrega e oferecendo maior conveniência para todos os nossos clientes.\r\n\r\nTemos como objetivo atender clientes e consumidores com produtos e atendimento de alta qualidade, sempre com pontualidade nos prazos de entrega.\r\n\r\nTemos uma equipe ampla e eficiente para que possamos sempre atender com a melhor e mais alta qualidade possível, todas as exigências de nossos consumidores.\r\n\r\nVisando assim a satisfação e conquistando cada vez mais clientes.','www.facebook.com/saturnobrindes','twitter.com/saturnobrindes','','Jardim Independência ',1134,7,'66.102.8.190','S','(11) 2347-9444','','2015-04-30 15:53:03',NULL,NULL),
	(2082,'Versattil Soluções em Tecnologia da Informação','','comercial@versattil.com.br','www.versattil.com.br','INFRA ESTRUTURA\r\nServiços de Cabeamento estruturado;\r\nMontagem e estruturação de Datacenter (Montagem de servidores em Rack, instalação de piso elevado etc.)\r\nCertificação de Redes;\r\nMapeamento e identificação de toda rede física;\r\nInventário de equipamentos;\r\nFibra óptica – Cabeamento e fusão\r\n	SERVIDORES\r\nProjetamos e implantamos redes com servidores baseados em sistemas operacionais VMWARE, Microsoft Windows Server e Conectiva Linux, para empresas de pequeno, médio e grande porte. Implementamos soluções de servidores de banco de dados, arquivos, impressão, acesso e gerenciamento de Internet, e-mail e Web.\r\nServidores de alta disponibilidade e escalabilidade com desempenho de acordo com a necessidade de cada aplicação e com altos níveis de exigência. Servidores Corporativos e Infraestrutura de Internet\r\nImplantação do Active Directory, DNS, DHCP.\r\n	MANUTENAÇÃO HARDWARE E SOFTWARE\r\nManutenção preventiva e corretiva em desktops e Notebooks;\r\nReparos e melhorias em estruturas de rede;\r\nInstalações de softwares;\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n	INTERNET E SEGURANÇA\r\nTemos a solução que sua empresa necessita para compartilhamento de acesso à Internet 	através de conexão ADSL E LINK DEDICADO com monitoramento e gerenciamento do uso de usuário. Segurança contra invasões e vírus centralizado no servidor, interligações entre matriz X filial e conexões de acesso remoto à rede da empresa por usuários autorizados. De acordo com a utilização e o emprego dos recursos de Internet que a disponibilizados pela empresa, implementamos serviços de controle e proteção, A VERSATTIL também desenvolve sistemas de backup customizados, adaptando-os à estrutura de sua empresa sem a aplicação de custos desnecessários.\r\nInstalação e configuração de Servidores de borda (Firewalls baseados em software);\r\nIsolamento da rede interna/externa para evitar invasão;\r\nProteção contra a infecção por vírus.\r\nLiberar e bloquear o uso por departamento/funcionário.\r\nControle de sites acessados.\r\nRotinas de Backup\r\nDefinição de política de acesso e uso das informações. \r\nProteção de senhas\r\nTELECOMUNICAÇÕES\r\nAtuamos na área de equipamentos e prestação de serviços em telefonia, telecomunicações instalação/estruturação de redes locais de computadores e controle de acesso a edifícios. Instalamos e configuramos toda a infraestrutura necessária. Oferecemos orientação e consultoria de qualidade.\r\nCONSULTORIA EM SISTEMAS\r\nTemos profissionais com larga experiência para ajudar sua empresa a escolher o melhor sistema, com maior aderência aos processos da sua empresa, bem como o acompanhamento e gerenciamento do projeto de implantação, com base no PMBOCK-PMI evitando desgastes com fornecedores e garantindo o alcance dos resultados de acordo com escopo e riscos preestabelecidos.\r\n\r\n\r\nREPRESENTAÇÃO COMERCIAL\r\nSomos revenda autorizada dos seguintes produtos:\r\nSoluções em Antivírus\r\n\r\nAo utilizar o Internet Banking, realizar compras ou navegar em redes sociais on-line, a Internet tem as mesmas ameaças – seja no computador ou no dispositivo móvel. O Kaspersky Internet Security – multidispositivos 2015 é a solução de licença única que protege sua identidade digital, suas finanças, suas informações confidenciais e seus filhos independentemente de você usar seu PC, Mac, celular ou tablet Android. É fácil combinar serviços de proteção para todos os seus tipos de dispositivos.\r\nSolução em Sistema de comunicação interna e externa\r\n\r\nO mySuite ajuda sua empresa a profissionalizar a comunicação com seus clientes internos e externos, construindo base de dados confiável, convertendo em relatórios para análises gerenciais e medindo o desempenho de sua equipe, possibilitando maior controle, gerando rastreabilidade das informações para a organização e maior transparência para os clientes.\r\nUm dos grandes diferenciais do mySuite frente aos concorrentes no mercado é a diversidade de recursos disponíveis. O produto conta com várias ferramentas, visando atender a diferentes necessidades empresariais.\r\nEssas ferramentas vão desde um prático sistema de recados internos, passando por controles de tarefas e pendências internas, comunicadores internos, e conta ainda com recursos para atendimento a clientes (CRM), gestão da informação e muito mais.\r\nCORPO TÉCNICO\r\nTécnicos focados com certificação LPI (LINUX Professional Institute); \r\nProfissionais certificados em Microsoft MCSE Windows; \r\nCertificados também em CISCO (CCNA, CCNP); \r\nEspecialista em sistemas de informação, ERP, WMS, TMS e desenvolvimento de software sob medida;\r\nEspecialista em gerenciamento de projetos de áreas diversas;\r\nProfissionais com sólidos conhecimentos nas áreas de negócios empresariais, processos e planejamento estratégico','','','','Coelho Neto',237,10,'201.49.221.114','N','21 37355909','','2015-04-30 16:20:38',NULL,NULL),
