	(2094,'Jornal Folha da Cidade','05.628.541/0001-82','folhadacidadesf@gmail.com','folhadacidadesf.com.br','Somos um jornal que circula há mais de 23 anos na região Norte Fluminense (interior do Rio de Janeiro). \r\n\r\n\r\n1. A empresa\r\nFundado em 1991, o Jornal Folha da Cidade reflete de forma eficiente o comportamento do leitor do interior do Estado. Em suas editorias, a universalidade dos assuntos é o principal interesse pois nosso objetivo é levar conteúdo e atualidade sobre a região em que estão inseridos cada leitor. \r\n\r\n2 - Estrutura\r\nA redação do Jornal Folha da Cidade tem sede própria e empresa instituída em conformidade e em local privilegiado, no Centro da cidade de São Fidélis. A empresa conta ainda com frota de veículo e moto para atender à demanda de distribuição em toda a região e equipe de reportagem, colunistas regionais e locais, editoria chefe e diagramação, além do time comercial, financeiro e de apoio.\r\n\r\n2- Periodicidade\r\nA edição do Jornal Folha da Cidade circula semanalmente, ás sextas feiras, na Região Norte Noroeste Fluminense.\r\n\r\n3- Distribuição\r\nAtualmente circulamos por 9 cidades onde soma-se mais de 100 pontos de distribuição estrategicamente definidos através de um estudo local de circulação de pessoas e de interesse.  São elas: São Fidélis, Cambuci, Aperibé, Santo Antônio de Pádua, Miracema, Cardoso Moreira, Italva, São José de Ubá e Itaocara.\r\nHá 24 anos a Folha se preocupa em levar conteúdo atual e de qualidade ao seus leitores, através da publicação de 2 mil exemplares semanais. Além de mais de 300 assinantes em todo o país.\r\nPara nós interessa a melhor distribuição, cuidando do qualitativo e  trabalhando para que o índice de retorno de distribuição seja sempre zero.\r\n\r\n4- Audiência\r\nCada ponto de distribuição recebe um kit de mídia para exposição e divulgação da Folha da Cidade de forma que o produto fique sempre visível e acessível. Além disso, uma equipe verifica periodicamente o posicionamento, estado e eficiência de cada ponto.\r\n\r\n5 - Valor de venda\r\nDas cidades onde circula a Folha da Cidade, somente a cidade de São Fidélis adquire a edição ao valor de R$1,00. Para as outras cidades a distribuição é  TOTALMENTE GRATUITA. \r\n\r\n6 – Anunciantes\r\nOs espaços publicitários são diagramados de forma a valorizar a marca da empresa e estão vinculados sempre ao interesse do público. \r\nCada anunciante recebe a visita de um corretor para a apresentação dos valores e espaços dedicados nas páginas do Jornal.\r\n\r\n7 – Impressão\r\nAs edições da Folha da Cidade são impressas em gráfica de alta qualidade e tradição, prezando a qualidade e leiturabilidade das edições e fidelidade às cores, imagens e ao produto final em si. \r\n','https://www.facebook.com/folhadacidadesf?fref=ts','','Av 7 de Setembro. 64 A','Centro',259,19,'187.19.51.92','S','(22) 99972-5931','','2015-05-04 21:13:16',NULL,NULL),
