	(2177,'Mogi Acrilicos','18528411/0001-10','contato@mogiacrilicos.com','www.mogiacrilicos.com','A MOGI ACRÍLICOS oferece produtos para diversas finalidades, sob medida e na quantidade que precisar. A fabricação é própria utilizando matéria prima de ótima qualidade, durabilidade e resistência, que após transformadas resultam em peças com extrema beleza, proporcionando elegância e sofisticação ao ambiente.\r\n \r\nAlém da qualidade do material e do acabamento, garantimos também qualidade na entrega utilizando materiais e métodos adequados para embalagem, entregador próprio na Grande São Paulo, para demais localidades enviamos pelo Correio (SEDEX ou PAC), com reforço na embalagem e seguro transporte.Confira a nossa linha de produtos, encontre a solução que precisa em acrílico, executamos projetos especiais, solicite um orçamento.\r\n \r\n \r\nAtendendo com máxima eficiência, agilidade, qualidade e grande satisfação.\r\n \r\n \r\n','https://www.facebook.com/Mogi-Acrílicos','','R. Ascenso Fernandes, 603','Pq Paulistano',1134,7,'177.45.140.88','S','112581-2923, 1196418-6528','','2015-06-02 16:36:45',NULL,NULL),
