	(2181,'PIN-CORF PINTURAS DE MIRASSOL LTDA','02550794000192','quality_pinturas@ig.com.br','www.qualityrevovada.comunidades.net','SERVIÇOS\r\nHidrojateamento Selagem das Fissuras Superficiais Tratamento das Trincas Dinâmicas\r\nPinturas Externas e Internas Graffiato Texturas Concreto Aparente Tijolos Aparentes Aplicação em manta asfáltica Superfícies em Madeira e Ferro SERVIÇOS COMERCIAIS\r\nPara estabelecimentos comerciais, shoppings, escritórios, magazines, lojas e comércio em geral atuamos de forma \"just in time\".\r\nNem sempre é possível executar um serviço em seu horário comercial ou ter tempo suficiente para realizar em poucos dias. Então escalonamos equipes para tais necessidades.\r\nCom flexibilidade e esforço ordenado, atingimos as metas para serviços diferenciados, estendendo ao máximo o trabalho para que possamos atender aos anseios de todos nossos clientes.\r\nSERVIÇOS PREDIAIS\r\nA Quality Pinturas possui equipes treinadas e especializadas para executar serviços em condomínios e prédios em geral.\r\nTanto para serviços externos, quanto internos, seguimos rigorosamente as normas e exigências da ABNT (Associação Brasileira de Normas Técnicas). Construção civil e Ministério do Trabalho. São pouquíssimas empresas que estão de acordo com essas normas.\r\nSERVIÇOS RESIDENCIAIS\r\nPara residências, dispomos de equipes altamente treinadas para executar serviços de fino trato, onde o diferencial está em atender os desejos e anseios dos clientes em querer possuir serviços personalizados.\r\n','','','R NAVARRET','NAVARRET',832,27,'191.29.57.66','S','1791858330','','2015-06-05 12:33:03',NULL,NULL),
	(2182,'Moveis Planejados SP - Cozinha Planejada - Escritório SP','','dcoratt@dcoratt.com','www.dcoratt.com','A Marcenaria D\'coratt Moveis Planejados SP e Móveis  Sob Medida está localizada na Avenida Doutor Assis Ribeiro, 460 A no bairro da Penha em SP, com fácil acesso pela Marginal Tietê e Avenida Guarulhos. \r\n\r\nQual a vantagem de fazer seus móveis planejados e sob medida para casa, apartamento, escritório, ou loja conosco? \r\n\r\n>Nosso marceneiro irá até você com algumas amostras de acabamento e tirará as medidas para que seus móveis fiquem perfeitos, na medida exata em sua casa ou empresa.\r\n\r\n>Móveis feito sob a medida que o cliente tem disponível, montamos seu projeto de como ficariam os móveis com o acabamento escolhido e te enviamos para aprovação.\r\n\r\n>Prazo de entrega sempre respeitado e cumprido, acordo feito através de contrato assinado.\r\n\r\n>Móveis feitos com MDF apenas, não usamos mdp, nem aglomerado. Prezamos a qualidade dos móveis, utilizamos as melhores marcas.\r\n\r\n>Facilitamos o pagamento parcelado, ou concedemos desconto para pagamento á vista e em 2 vezes. \r\n\r\n>Durabilidade dos móveis, como não somos lojas de planejados e sim marcenaria, nossos móveis são feitos com MDF e não mdp e aglomerado, se forem bem cuidados pelos clientes nossos móveis podem durar por até 20 anos, podendo ser reformado sem precisar comprar novamente.\r\n\r\n> Fabricamos Moveis para casa, Moveis para escritorio, moveis para loja, tudo com contrato assinado e entrega garantida.\r\n\r\n>Acabamento impecável, somos detalhistas, por isso somos reconhecidos como uma das melhores marcenarias de SP e Guarulhos.\r\n\r\nNossa marcenaria é reconhecida pelo acabamento impecável e pelas condições de pagamento. Estamos lado a lado com nossos clientes, o que estiver em nosso alcance nós faremos para que nosso orçamento caiba em seu bolso.\r\n \r\nSolicite seu orçamento de móveis planejados em São Paulo através dos telefones (11)2085-6168 (11)94159-1170 WhatsApp, ou nos procure na internet: Marcenaria D\'coratt Móveis Planejados e Sob Medida.\r\n \r\nEntrem em contato conosco para nos conhecer melhor e ter certeza de nossa credibilidade e eficácia. Agende uma visita, teremos o prazer de atendê-los em sua residência ou empresa, levamos algumas amostras e montamos seu projeto de móveis planejados e sob medida.\r\n\r\nCozinha Planejada - Cozinha Pequena Planejada - Sala americana - Cozinha americana - Quarto casal - Quarto Planejado - Guarda roupa casal - Guarda roupa planejado - Quarto bebe - Quarto solteiro - Guarda roupas - Gabinete Cozinha - Gabinete banheiro - Moveis para escritorio sp - Moveis para Loja SP.\r\n','https:facebook.com/dcorattmoveis','','Avenida Doutor Assis Ribeiro, 460 A','Penha',1134,18,'177.103.184.69','S','(11)2085-6168,(11)94159-1170','','2015-06-05 13:53:52',NULL,NULL),
