	(2192,'Bella Rocha','20.841.842/0001-83','atendimento@bellarocha.com.br','http://www.bellarocha.com.br','Em busca do inusitado e disposta a entender a necessidade do cliente, a Bella Rocha é uma agência de propaganda que nasce com um sonho, o de cultivar o respeito entre as pessoas e o mundo. Conectando-as através de ideias e conceitos que permitam um diálogo claro entre as marcas e o consumidor.\r\n\r\nE O QUE HÁ DE NOVO NISSO?\r\n\r\nConvenhamos, de discurso o mercado está cheio e o que podemos dizer de nossa agência é que colocamos nossos talentos e nossa energia a disposição da sua empresa, acreditando que podemos criar soluções alternativas que atinjam os objetivos da comunicação.\r\n\r\nEVOLUA\r\n\r\nO novo está em se permitir, não se estagnar, ir além, juntos! Onde tudo é válido, desde a sua história de vida, suas habilidades e o seu olhar para as oportunidades. Não se tornar mais um formatado pelo senso comum. Sim, esse é um manifesto! Um manifesto pela reinvenção, pelo redesenho, para juntar as peças de um jeito novo, um manifesto para que você crie também, um convite para a evolução.','https://www.facebook.com/bellarocha','https://www.twitter.com/bellarocha','Rua Carlos Gomes, 846','Centro',783,5,'177.188.75.118','N','(19) 3039-1398','','2015-06-12 11:00:32',NULL,NULL),
	(2193,'Capptan','','paulo@capptan.com.br','www.capptan.com','A Capptan cria aplicativos (Android, iOS e Windows P.) integrados a painéis administrativos inteligentes. Em diversos casos os aplicativos desenvolvidos pela Capptan são a base para o negócio do cliente. Lojas online, delivery\'s e fornecedores de produtos/serviços personalizados são bons exemplos. \r\n\r\nApostamos na promissora plataforma mobile e em um ambiente colaborativo que se preocupa com a evolução constante de sua equipe. A satisfação do cliente final assim como o bem estar dos colaboradores e parceiros são reflexos dessas características. \r\n\r\nCaptamos sua necessidade, criamos o aplicativo adequado e compartilhamos seu sucesso.','www.facebook.com.br/capptanapps','','Av. Nildo Ribeiro da Rocha, 3853 - Maringá','Jardim Higienópolis',7566,4,'189.26.77.27','N','(044) 4052-9033, (044) 9103-3400','','2015-06-12 23:38:12',NULL,NULL),
	(2194,'Speedpak Soluções Logisticas','','elaine.jesus@speedpak.com.br','www.speedpak.com.br','Somos a Speedpak Soluções Logísticas TRANSPORTADORA, atuamos há 26 anos em todo Brasil com transporte de cargas aérea, rodoviária e logística promocional. Fornecemos também serviços de malotes (mala expressa), armazenagem, controle de estoque e montagem de kits promocionais. Serviço de Transporte Aéreo Nacional e Internacional Serviço de transporte aéreo expresso de documentos (courier), encomendas e cargas. Aéreo Standard - Entrega porta a porta.Entregas entre 8:00 as 18:00 horas, sem agendamento. Aéreo Emergencial - Entrega com agendamento. Aéreo Carga Expressa - Entrega com garantia de embarque. Aéreo Hot Situation - Acompanhamento pessoal. Aéreo Fretado - Fretamento de aeronave. Aéreo Internacional - Entrega em mais de 220 países. Rodoviário Nacional Serviço de transporte rodoviário expresso de documentos, encomendas e cargas. Ambos os serviços, Aéreo nacional e Rodoviário nacional, possuem tempo de trânsito definido, cujo cumprimento é garantido caso não ocorra atrasos decorrentes de motivos de força maior ou de qualquer outro fator fora do controle da Speedpak. Rodoviário Standard - Entrega porta a porta. Entregas entre 8:00 as 18:00 horas, sem agendamento. Rodoviário Emergencial - Entrega com agendamento. Rodoviário Exclusivo - Transporte exclusivo para a entrega; frota dedicada Rodoviário Dedicado - Gestão de expedição. Todos os pedidos de separação em estoque assim como nossas entregas são rastreados via web, possuímos atendimento personalizado e operamos com base nos requisitos da ISO 9001:2008. Temos uma filial no RJ com 1200 m², e operamos com rota diária para este trecho (RJ x SP), o que viabiliza uma maior competitividade e entregas realizada menos que 24hs na grande São Paulo. Além disso, temos 64 bases operacionais espalhadas pelo país, nos grandes centros e nas principais capitais brasileiras. Atendemos a nível Brasil. Elaine P. Jesus Promotora de Transportes - Filial RIO elaine.jesus@speedpak.com.br Fixo: 21 2590-8011 / 3882-1380 RAMAL 208 Celular: 21 9 9498-5962 / WhatsApp: 21 9 9498-5962','','','Rua Aguiar Moreira, 244','Bonsucesso',237,2,'201.36.144.114','S','21994985962','','2015-06-15 15:45:23',NULL,NULL),
