	(2227,'LV DA SILVA TERCEIRIZAÇÕES ERELLI','09564577000109','flterceirizacoes@uol.com.br','flseguranca.com.br','\r\nSomos uma empresa do ramo de prestação de serviços nos segmentos portaria, zeladoria, vigilância, copa, limpeza residencial/empresarial e conservação, manobrista, ascensorista, jardinagem, recepção, monitoramento, \r\nCabe ressaltar que atuamos no mercado desde 2008, nos qualificando e aprimorando, visando satisfazer nossos clientes.\r\nTemos técnicos e mão de obra especializada, sendo nossos colaboradores treinados, capacitados e comprometidos com os serviços prestados.\r\nNossa empresa está preparada para atender clientes de pequeno e médio porte, oferecendo sempre uma solução inteligente e econômica para quem necessita terceirizar os serviços acima citados.\r\nPodemos contribuir de forma positiva para sua empresa, com serviços realizados de acordo com as normas de qualidade que prezamos dentro da nossa organização, incluindo garantia contratual em todos os serviços prestados.\r\nBuscamos estabelecer uma relação transparente com os nossos clientes, oferecendo suporte através do atendimento diferenciado, em horário comercial de segunda a sexta e emergencial aos finais de semana e feriados, através dos telefones de contato: DDD xxxx.xxxx.\r\nEstamos à disposição para esclarecer eventuais dúvidas, onde aguardamos o seu contato!\r\n','','','Rua Santa Gregoria, 67','Cidade Dutra',1134,3,'186.220.121.179','S','(011) 3556-2851/5666-3752','','2015-06-16 13:37:33',NULL,NULL),
