	(2230,'kapp Brasil','22.233.871/0001-98','artefatosmetalicos@yahoo.com.br','www.kappbrasil.com.br','Boa tarde.\r\nVeio por meio deste e-mail, Formalizar a apresentação da minha micro empresa Kapp do Brasil em seus arquivos de fornecedores e parceiros.\r\n\r\nAtendo pelo nome de Paulo Brasil atuo no ramo de montagens de Estruturas Metálicas( atuo como empreiteiro) bem como na fabricação de artefatos metálicos em serralheria artística e industrial.\r\n\r\nA Kapp Industrial do Brasil, é uma micro empresa voltada para a atividade metalúrgica.\r\nNossa empresa oferece aos construtores,arquitetos,engenheiros e a todo mercado nacional mão de obra para montagens de estruturas metálicas e serviços.\r\nAtuante no processo de montagens á 35 anos prestando serviços de qualidade e pontualidade. \r\nNossa empresa  é direcionada para empresas de pequeno,médio e grande porte ,cujo a sua atividade é de construções e de manuseio de equipamentos e que tem como objetivo atender  seus clientes.\r\nBuscando uma parceria com essas empresas, nossa empresa tem conhecimento necessário para satisfazer  a sua clientela no âmbito de mão obra em montagens .Prestando serviços de mão de obra e fabricação de artefatos metálicos.\r\nEspecificação,trabalhos executados pela Kapp, ( soldagem em alta escala no processo mig mag,portões automáticos,portões articulados para industriais,escadas metálicas,bancadas,mezaninos,passarela,estruturas metálicas,chaparias de baixa e média espessura,carrinhos industrias e toda gama de serviços,etc...)\r\nA Kapp Industrial do Brasil dispõe de cnpj,emissão de nota de prestação de serviço, bem como qualidade e pontualidade nos contratos firmados e prestados.\r\nO motivo da nossa empresa entrar em  contato, é de estreitarmos os nossos laços empresarias e de poder servirmos a vossa empresa com comprometimento,responsabilidade e acima de tudo poder levar ao nosso cliente confiança. \r\nOBS; ( Eu Paulo Brasil atuo no ramo à 35 anos prestando serviços a varias empresas como autônomo,possuo conhecimento na área e experiência suficiente para tocar qualquer trabalho do gênero,a Kapp do Brasil encontra-se formalizada e documentada em todos os órgãos públicos desde do ano de 2015 como (ME) por motivo de alteração em nosso (CNPJ) que era constituído como (MEI) e passou a ser (ME).\r\nAo longo desses anos \"EU Paulo Brasil atuava informalmente como empreiteiro de mão de obra\".)   \r\nEm 2012, Nasce a Kapp Industrial do brasil, resultado de um sonho familiar: Karina Brasil,Ângela Brasil,Paula Brasil e Paulo Brasil e assim nasceu o nome: Kapp do Brasil, \r\nA nossa empresa atende desde o pequeno construtor à  grandes construtoras, indústrias, usinas e prestadores de serviços em geral.\r\n \r\nContato: E-mail kappbrasil@yahoo.com.br\r\nFone: (11) 2053-0034  /  (11) 9-5334-7935 Tim  /  (11) 9-7398-8078 Vivo  /  (11) 9-6815-7595 Oi','','','Rua:B.B.Varela,391','Itaquera',1134,27,'187.38.190.110','N','11953347935','','2015-06-17 14:29:10',NULL,NULL),
	(2233,'Kapp Brasil','22.233.871/0001-98','kappbrasil@yahoo.com.br','www.kappbrasil.com.br','Bom dia.\r\nVeio por meio deste e-mail, Formalizar a apresentação da minha micro empresa Kapp do Brasil em seus arquivos de fornecedores e parceiros.\r\n\r\nAtendo pelo nome de Paulo Brasil atuo no ramo de montagens de Estruturas Metálicas( atuo como empreiteiro) bem como na fabricação de artefatos metálicos em serralheria artística e industrial.\r\n\r\nA Kapp Industrial do Brasil, é uma micro empresa voltada para a atividade metalúrgica.\r\nNossa empresa oferece aos construtores,arquitetos,engenheiros e a todo mercado nacional mão de obra para montagens de estruturas metálicas e serviços.\r\nAtuante no processo de montagens á 35 anos prestando serviços de qualidade e pontualidade. \r\nNossa empresa  é direcionada para empresas de pequeno,médio e grande porte ,cujo a sua atividade é de construções e de manuseio de equipamentos e que tem como objetivo atender  seus clientes.\r\nBuscando uma parceria com essas empresas, nossa empresa tem conhecimento necessário para satisfazer  a sua clientela no âmbito de mão obra em montagens .Prestando serviços de mão de obra e fabricação de artefatos metálicos.\r\nEspecificação,trabalhos executados pela Kapp, ( soldagem em alta escala no processo mig mag,portões automáticos,portões articulados para industriais,escadas metálicas,bancadas,mezaninos,passarela,estruturas metálicas,chaparias de baixa e média espessura,carrinhos industrias e toda gama de serviços,etc...)\r\nA Kapp Industrial do Brasil dispõe de cnpj,emissão de nota de prestação de serviço, bem como qualidade e pontualidade nos contratos firmados e prestados.\r\nO motivo da nossa empresa entrar em  contato, é de estreitarmos os nossos laços empresarias e de poder servirmos a vossa empresa com comprometimento,responsabilidade e acima de tudo poder levar ao nosso cliente confiança. \r\nOBS; ( Eu Paulo Brasil atuo no ramo à 35 anos prestando serviços a varias empresas como autônomo,