	(4279,'Get Hero Agência de Domésticas e Serviços em geral','','rh@gethero.com.br','http://www.gethero.com.br/','A agência GET HERO trabalha com recrutamento e seleção de profissionais domésticos e serviços em geral incluindo profissionais de nível de técnico e superior. Trabalhamos com diversos tipos de serviços, para residência, condomínios, empresas (lojas, consultórios, escritórios, salas comerciais, etc) e também oferecemos terceirização de mão de obra.\r\n\r\nServiço de recrutamento e seleção, indicação de profissionais de acordo com o perfil pré estabelecido pelo cliente, terceirização de mão de obra qualificada, serviços de limpeza (lojas, consultórios, escritórios, salas comerciais, etc), serviços de limpeza pré e pós obra, personal organizer para mudança, mão de obra para eventos. Temos profissionais domésticos prontos para atender nossos clientes: motorista particular, passadeira, lavadeira, doméstica, diarista, arrumadeira, passadeira, copeira, jardineiro, porteiro, zelador, segurança, caseiro, babá, cuidador de idosos, cozinheira e recepcionista.\r\n\r\nOs profissionais aqui cadastrados passam por um processo rigoroso de checagem de antecedentes, documentos e referências, além de exame médico e psicológico, esse processo é para garantir a qualidade do serviço prestado e a segurança e satisfação dos nossos clientes. Nosso principal objetivo é entregar o melhor serviço e garantir os melhores preços.\r\n\r\nOrçamento rápido, agilidade para atender a solicitação do cliente, compromisso, profissionais qualificados com experiências comprovadas.','https://www.facebook.com/getherooficial/','','Rua Senador Madureira, 533','Vila Mariana',1134,3,'177.94.58.1','S','11987554810','','2017-04-20 02:16:19',NULL,NULL),
