	(4282,'Camila Pimentel Makeup','','Camilamenta@hotmail.com','','Curso de Automaquiagem para empresas\r\n\r\nEm empresas que possuem atendentes que lidam pessoalmente com o público, é muito importante que a maquiagem seja padronizada e condizente com o mercado de atuação. Por isso oferecemos a consultoria de maquiagem para essas empresas, traduzindo a imagem que a coordenadora das atendentes deseja transmitir aos seus clientes através da maquiagem. Pode ser em formato de curso de auto maquiagem ou workshop. Para maiores informações e orçamento entre em contato conosco informando o número de participantes, o objetivo do curso e público que a empresa atende e os melhores dias e horários para realização do curso.','Camila Pimentel Makeup','','Rua Raimundo Correa, ','Copacabana',237,25,'179.218.77.33','S','21 98843-9479','','2017-04-20 16:06:31',NULL,NULL),
	(4284,'Pippo Ferreira - Fotografia de Casamento','','workshopdecasamento@gmail.com','nossofotografo.com.br','Escolher o fotógrafo de casamento é uma decisão muito importante e estamos prontos pra ajudá-los, tornando essa tarefa o mais fácil possível.\r\nINVESTIMENTO\r\nA cobertura dos casamentos começa em R$2.500 e ensaios em R$800.\r\n- Não deixe de pedir o orçamento completo para saber mais a respeito dos valores de álbuns e outros itens.\r\nFORMA DE PAGAMENTO\r\nRecebemos por depósito bancário, boleto ou cartão de credito. O cliente pode tanto pagar à vista com desconto como parcelado em até 10x.\r\nENTREGA\r\nEntregamos as fotografias do casamento em alta resolução todas editadas e sem marca d\'água e até 80 fotos para ensaios, entregues em 45 dias após o evento e o álbum 90 dias após aprovação. Em até 7 dias após o casamento e enviado um seleção \'Best Selected Wedding\' de até 100 Fotos.\r\nREUNIÃO\r\nPodemos marcar em Itapeva. Se não puderem, fazemos uma reunião virtual, através de uma vídeo conferência pelo Skype ou Telefone.\r\nPara dúvidas e orçamentos: Preencha as Informações abaixo.\r\n','https://www.facebook.com/pippoferreira','','Alipio de Almeida Camargo 121','Jd Belvedere',708,14,'177.95.72.124','S','15 997748303','','2017-04-23 01:50:01',NULL,NULL),
