	(4333,'ECOLD CLIMATIZAÇÃO E SERVIÇOS DE ENGENHARIA LTDA-ME','24988359000187','CONTATO@ECOLD.COM.BR','WWW.ECOLD.COM.BR','Prezado(a),\r\n\r\n    Venho por meio deste contato lhe apresentar a Ecold Climatização, empresa especialista no mercado de climatização.\r\n\r\n    Estamos localizados no Rio de Janeiro, e possuímos registro junto aos órgãos responsáveis por fiscalização (CREA-RJ e a GEM).\r\n\r\n    Fundada por dois Engenheiros Mecânicos a Ecold Climatização vem alcançando um crescimento mês após mês, pois nossa proposta é realizar um serviço de qualidade prezando pelo bom relacionamento entre empresa e cliente.\r\n\r\n    Nossa Equipe está sempre em crescimento e treinamento continuo para que tenham como base nossa filosofia de atendimento, com essa iniciativa agregamos parceiros importantes\r\n\r\n    Temos como objetivo a excelência do exercício de refrigeração, ventilação e exaustão mecânica disponibilizando o que há de mais moderno, eficaz e eficiente no mercado, proporcionando aos nossos clientes, serviços de qualidade e alta tecnologia e buscando sempre soluções que atendam a todas as necessidades com ética e agilidade, por meio de um atendimento de alta qualidade.\r\n\r\n    Agindo desta forma temos a certeza que os nossos clientes terão satisfação em dividir tarefas conosco.\r\n\r\n    Temos como Base um escritório em Niterói-RJ, onde realizamos todas as atividades de planejamento e gestão das atividades da empresa.\r\n\r\n    Trabalhamos com as linhas domésticas e comerciais, tanto de pequeno como grande porte, exemplos: split, splitão, self-contained, fancoil, chiller, VRF, dentre outros.\r\n\r\n    Realizamos os serviços de instalação, manutenção (preventiva e corretiva), PMOC, vendas e projetos.\r\n\r\n    Estamos a disposição para sanarmos suas dúvidas, realizarmos orçamentos e prestarmos maiores esclarecimentos dos serviços.\r\n\r\n    Nossa proposta é ser um fornecedor da Rede no segmento de Manutenção dos sistemas de climatização e exaustão mecânica, e estamos nos disponibilizando para realizar visitas técnicas para avaliar as unidades e apresentar propostas comerciais para que essa parceria se concretize, buscando sempre a vantagem para o cliente de ter um atendimento mais exclusivo e ainda ter uma possível redução nos custos operacionais das suas unidades.','','','RUA FAGUNDES VARELA','INGA',183,3,'189.106.75.3','N','2131922241','','2017-05-09 11:33:28',NULL,NULL),
