	(252,'lasertools','','vendas.industrial@lasertools.com.br','http://www.lasertools.com.br/detalhes.asp?Codigo=06','A LaserTools iniciou a comercialização dos seus serviços em uma sala de aproximadamente 40m2 no Centro de Incubação de Empresas Tecnológicas (Cietec) no IPEN, e recorreu ao Programa de Inovação Tecnológica em Pequenas Empresas (PIPE) da FAPESP.\r\n\r\nHoje, a LaserTools conta com duas unidades. Matriz: onde estão localizados os setores administrativos, Pesquisa e Desenvolvimento atendendo especificamente os setores Médico/Odontológico e Industrial. Filial: exclusiva para atendimento ao setor Promocional.\r\nO quadro funcional é formado por mais de 30 profissionais entre eles físicos, engenheiros e técnicos. \r\n\r\nA LaserTools foi a precursora da tecnologia de gravação a Laser no país, seu principal diferencial é o conhecimento e as constantes pesquisas sobre a aplicação dos lasers, que permite desenvolver soluções rápidas e eficientes para atender as necessidades dos seus clientes e do mercado.\r\n\r\nNossas raízes oriundas da mais renomada Instituição de Ensino e Pesquisa do país continuam fortes e consolidadas.','','','Dr. Pedro Arbues, 149 -CEP: 01105-030 ','luz',1134,7,'177.102.0.64','S','Tel: (11) 3227-6827','','2013-08-07 08:51:41',NULL,NULL),
	(253,'Arte Premium ( Gráfica & Editora ) ','14.504.536/0001-59','vendas2@artepremium.com.br','www.artepremium.com.br','Olá! Bom dia.\r\nSou Gil Rodrigues, consultor executivo na Arte Premium  (gráfica e editora), é por meio deste que lhes apresento nossos serviços.\r\nTrabalhamos com os mais diferenciados materiais e serviços, garantindo qualidade, ótimos prazos, e preços competitivos.\r\nOBS; podemos fornecer desde um simples cartão de visita a banners, Cadernos, agendas, portfólio, etiquetas adesivas em papel, material para escritório como agendas, cadernos calendários etc. E variados tipos de material gráfico.\r\nImpressos:\r\n•	Adesivos\r\n•	Criação e finalização\r\n•	Banners\r\n•	Catálogo\r\n•	Cartão de visita\r\n•	Envelopes\r\n•	Encartes para CD\r\n•	Folder\r\n•	Folhetos\r\n•	Panfletos\r\n•	Papel de carta\r\n•	Diagramação \r\n•	Sinalizações\r\n•	Placas\r\n•	Brindes;\r\n•	Anúncios;\r\n•	Ações de Mídia impressa;\r\n•	Planos de Marketing;\r\n•	Campanhas Publicitárias;\r\n•	Campanhas Institucionais;\r\nNossa principal vantagem é nosso prazo de entrega, uma vez que não terceirizamos os serviços por termos maquinas próprias.\r\nDeixo aqui meu contato e estou a disposição para o que precisar.\r\nAgradeço a Atenção.\r\n\r\n\r\nhttps://www.facebook.com/ArtePremium?fref=ts\r\n\r\n\r\nhttp://www.artepremium.com.br/\r\n','https://www.facebook.com/ArtePremium?ref=tn_tnmn','https://twitter.com/','R. Olívia Guedes Penteado, 640 - Socorro, São Paulo. SP CEP:  04766-000 ','Socorro',1135,1,'189.33.86.129','S','11987479050, 11 55210985','','2013-08-07 09:56:07',NULL,NULL),
