	(324,'Zebu Mídias Sustentáveis','16.946.874/0001-76','marcos@zebumidias.com.br','zebumidias.com.br','A ZEBU Mídias Sustentáveis (zebumidias.com.br) tem o objetivo de promover, divulgar, desenvolver e elaborar design gráfico e de produto, com foco no uso de materiais  ambientalmente responsáveis.\r\n\r\nA nossa meta é agregar valor à marca do cliente com suportes de comunicação e aplicações não convencionais. Dessa forma, os projetos tornam-se: embalagens, rótulos, sinalizações, brindes, painéis, impressos, expositores, cartões, dentre outros, que, combinados, criam um sistema de comunicação empresarial completo.\r\n\r\nRelacionamos diferentes tipos de conhecimento, aplicados nas áreas de comunicação, publicidade, design, processos e materiais. E, dessa forma,  foi criada uma nova categoria de mercado no Brasil, nomeada a partir do slogan, “Mídias Sustentáveis”.\r\n\r\nDentre os produtos que a ZEBU desenvolve, destacam-se as Tintas Orgânicas, produzidas artesanalmente à base d’água e de pigmentos extraídos diretamente de verduras, legumes, temperos e raízes. Utilizadas atualmente em impressões em papel e madeira, as tintas são compostas por 26 pigmentos diferentes (tais como, uva, urucum, cacau e beterraba).\r\n\r\n> Stencil limpo, painel verde, casca de bambu, tintas orgânicas, divulgação em coco.','https://www.facebook.com/zebumidias','','Rua Senador Pompeu, 82','Centro',237,19,'200.218.252.101','S','21 85628826','','2013-08-26 17:52:49',NULL,NULL),
