	(365,'COOL TOWELS','01.028.750/0001-34','vendas@cooltowels.com.br','www.cooltowels.com.br','	As COOL TOWELS são Toalhas Refrescantes,  produto inédito no Brasil, trazido da Thailandia com exclusividade pela ITC do BRASIL, sucesso na Europa, Asia, Oriente Médio e Estados Unidos.\r\n\r\n	Ideal para situações quentes, para que você possa focar no que realmente interessa, DIVERTIR-SE.\r\n\r\n	As toalhas vêm em embalagens individuais e para refrescarem não precisam de armazenamento em nenhum local específico. Entretanto, quando colocadas na geladeira tem seu efeito potencializado. São confeccionadas em tecido 100% algodão e não provocam alergia. Após a utilização podem ser lavadas e usadas como uma toalha comum.\r\n	\r\n	Sua utilização é simples. Basta tirá-la da embalagem, agitar e aplicar ao redor do pescoço, nos braços ou em qualquer outro lugar para sentir o frescor instantâneo. A sensação de frescor permanece na toalha enquanto ela estiver umedecida, ou seja, basta umedecê-la levemente quando começar a secar. Se a COOL TOWELS aquecer com a temperatura do corpo, basta balançar, pois em contato com o ar, reativa sua fórmula.\r\n\r\n      Existe a opção de personalização da embalagem e para volumes maiores tambem da toalha.','www.facebook.com/cooltowels','','','Vila Mariana',1134,7,'177.33.205.10','S','42-32322272, 11-99469-1458','','2013-09-04 15:27:05',NULL,NULL),
