	(532,'Vision Consulting ','','(011)2613-5708','www.consultoriaglobal.com.br','Consultoria Digital\r\nDesenvolvemos websites, prestamos consultoria para empresas comprometidas com o ambiente online, sempre com uma mão apresentando soluções de tecnologia e a outra controlando a qualidade da marca da empresa na internet.\r\n\r\n \r\n\r\nTemos como especialidade apresentar soluções que realmente funcionam que possuam escalabilidade e que sejam completamente gerenciáveis. Para isso, utilizamos ambientes sólidas no mercado que agregam qualidade e usabilidade à um ótimo custo/benefício, aliado ao design e identidade visual da empresa.\r\n\r\nVisamos a implementação de plataformas administrativas completamente dinâmicas, agregadas a funções de controle, gerenciamento e segurança para os administradores do site com a proposta de agilizar o processo de atualização e melhorar a comunicação com os clientes e colaboradores de sua empresa.\r\n\r\n \r\n\r\nQuais formatos de websites podemos desenvolver?\r\n\r\n Institucionais: Sites mais usuais destinados para comunicação externa, com objetivo de divulgar a empresa, seus produtos e serviços. \r\n\r\n Portais: Projetos com maior estrutura e complexidade. Normalmente, possuem diversos canais e espaços publicitários.\r\n\r\n Intranet: Ideal para comunicação interna entre funcionários, clientes e fornecedores.\r\n\r\n E-Commerce ou Comércio Eletrônico: Para fins comerciais, venda de produtos.\r\n\r\n Hotsites: Sites com pequena estrutura e temporários. Apropriado para ações promocionais. \r\n\r\n Lembrando também que podemos redesenhar o seu site já existente.\r\n\r\n \r\n\r\nLinguagens utilizadas\r\n\r\nPodemos utilizar diferentes linguagens / tecnologias para a criação de seu site: HTML, XHTML, CSS, ASP, Javascript, Flash, etc.\r\n\r\nA opção pelo uso de cada uma dessas linguagens depende da necessidade apresentada pelo cliente.\r\n\r\n \r\n\r\nManutenção\r\n\r\nO serviço de manutenção visa assegurar a atualidade do seu website.\r\n\r\nEstão contemplados serviços de Programação, Design e Gestão de Conteúdos (redação e edição).\r\n\r\n \r\n\r\nRegistro de Domínio e Hospedagem de sites\r\n\r\nO Registro de Domínio é um nome amigável para que um serviço de internet (como um website) possa ser acessado na internet. \r\n\r\nExemplo: para que seu site possa ser encontrado na internet pelo endereço seusite.com.br, você precisará de um serviço de hospedagem para disponibilizar os arquivos do site e também registrar este endereço (desde que ainda não tenha sido usado por outra pessoa) em um órgão registrador para atribuí-lo à sua hospedagem. \r\n\r\nA LM Design Gráfico atua como intermediadora para que você registre e renove (anualmente) domínios com as extensões: .com /.com.br / .net / .org / .br, etc.\r\n\r\nOs Planos de Hospedagem LM, oferecem Espaço e E-mails ilimitados, além das estatísiticas de acesso ao seu site.\r\n\r\n\r\n\r\nLeia mais: http://www.consultoriaglobal.com.br/servi%c3%a7os/consultoria-digital-/','https://www.facebook.com/visionandconsulting','','Rua Itapeti 755','Tatuape',1134,5,'179.99.212.229','S','','','2013-11-25 15:09:57',NULL,NULL),
