	(707,'BRASIL EXPRESS GRAFICA E EDITORA LTDA - EPP ','04.163.407/0001-90','danielle@graficabexs.com.br, danielleprata.br@gmail.com','www.graficabexs.com.br','Serviços gráficos , acompanhados de manuseio e postagem quando necessário.\r\n\r\nCom a experiência de mais de 10 anos no mercado, da pré-impressão ao acabamento, conseguimos atingir todos os requisitos necessários para um ótimo serviço e pontualidade na entrega dos materiais.\r\n\r\nPré Impressão e Impressão Offset _____________________________________\r\n\r\nCom foco na produção de impressos comerciais e promocionais como, papelaria, folders, embalagens, malas direta, catálogos etc. A equipe da BEXS, além da tecnologia de ponta, é altamente qualificada e treinada para acompanhar a evolução do mercado e estar sempre dentro dos padrões de qualidade da indústria gráfica.\r\n\r\nTrabalhando com uma tecnologia de última geração, nossos serviços tem total garantia, com provas de cores digitais ou convencionais, perfil de cores, gravação de chapas em CTP, com compensação de ganho de pontos para vários papéis, retículas especiais, entre outros recursos modernos e inovadores.\r\n\r\nAssim desde as peças mais simples até as mais elaboradas e criativas, o resultado é sempre um trabalho onde profissionalismo, eficiência e tecnologia asseguram um padrão de qualidade impecável.\r\n\r\nSeja qual for sua necessidade estamos prontos para produzir seu material em grandes e pequenas tiragens, sempre preservando a precisão dos detalhes.\r\n\r\n  Flyer\r\n\r\n  Folhetos\r\n\r\n  Folders\r\n\r\n  Cartazes\r\n\r\n  Informativos\r\n\r\n  Revistas\r\n\r\n  Envelopes\r\n\r\n  Pastas\r\n\r\n  Cartões de Visita\r\n\r\n  Calendários\r\n\r\nImpressão Digital PB _________________________________________\r\n\r\nA tecnologia alemã da marca Heidelberg está sendo operada por nossos profissionais especializados, \r\ngarantindo assim um alto padrão de qualidade.\r\n\r\n  Mala Direta\r\n\r\n  Boletos\r\n\r\n  Etiquetas de Endereçamento\r\n\r\n  Personalização de Impressos\r\n\r\n  Código de Barras\r\n\r\n  Impressão de Dados Variáveis\r\n\r\nImpressão Digital Collor _______________________________________\r\n\r\n\r\nO conceito de Impressão é amplo e vem se modificando ao longo do tempo.\r\nO sistema de impressão digital resulta visualmente, imprimindo diretamente de arquivos eletrônicos, \r\npossibitando alterações, atualizações ou correções a cada tiragem.\r\n\r\n  Impressão em lona, adesivo, papel e tecido\r\n\r\n  Tinta ecológica a base d\'água, sem cheiro para uso interno e externo, com garantia.\r\n\r\n  Impressão em alta definição e fidelidade de cores, para pessoas que exigem qualidade.\r\n\r\n\r\nAcabamento Especial ______________________________________\r\n\r\n\r\nÉ nessa fase final que podemos acrescer detalhes aos impressos dependendo do serviço confeccionado. \r\nIncluiu cortes especiais, vinco, furo, serrilha, colagem, encadernação, aplicação de verniz U.V e especial\r\n (total ou localizado), plastificação fosca/brilho, BOPP, entre outros.\r\n\r\nBrasil Express Gráfica e Editora\r\n\r\nDanielle Prata - Depto. Comercial\r\n\r\n21- 3888-1110 / 21-980876860\r\n\r\nwww.graficabexs.com.br','','','Av. Arapogi, 531','Braz de Pina',237,1,'201.51.86.247','S','21980876860, 38881110','','2014-02-21 10:28:38',NULL,NULL),
	(708,'V M SERVICOS POSTAIS E TELEGRAFICOS LTDA - ME  ','40.357.642/0001-67','danielleprata.br@gmail.com, danielle@graficabexs.com.br','www.correios.com.br','AGF - Definição: Agência de Correios franqueada são agências que funcionam dentro das normas e determinações da ECT. Operam como qualquer agência convencional, tendo toda sua carga expedida, transportada e tratada pela Empresa Brasileira de Correios e Telégrafos.\r\n	\r\nPOSTAGEM - Conceito: os serviços de postagem consistem no branqueamento, aplicação de selos, carimbos, etiquetas para registros com códigos de barra, de acordo com os padrões da ECT, através dos seguintes serviços prestados em nossa agência:\r\n\r\nSERVIÇOS CONVENCIONAIS                           CONTRATOS CUSTOMIZADOS\r\n\r\n*Sedex 	 		 \r\n*E – sedex\r\n*Sedex10                                 *Sedex contrato\r\n*Sedex c/ valor declarado                                *Impresso especial\r\n* Serviços internacionais                           *Fac\r\n*Cartas e impressos (simples e registrados)\r\n* Mala direta postal\r\n* Pac	                              \r\n* Entrega direta\r\n\r\nAs tarifas referentes aos serviços são as mesmas aplicadas diretamente pela ECT.  Fornecemos todas as tabelas Oficiais e atualizadas.\r\n\r\nFATURAMENTO\r\nOs serviços prestados em nossa agência, serão faturados, tendo seu prazo definido conforme o entendimento entre as partes.\r\nEstamos colocando a sua disposição todas as vantagens que sua empresa pode desfrutar em nossos serviços.\r\n\r\nACOMPANHE SUA POSTAGEM\r\nAtravés de nosso site, você acompanha diariamente sua postagem do período, bem como, realiza rastreamento de serviços registrados, basta receber seu código de acesso.\r\n\r\nCOLETA EM DOMICÍLIO	\r\nDentre todos os serviços prestados em nossa agência, gostaríamos de destacar o serviço de coleta em domicílio.\r\nFundamental para muitas empresas, o serviço de coleta contribui sensivelmente para redução de tempo e de custos operacionais.\r\n\r\n','','','Av. 