	(1335,'AQUATECH - Química e Meio Ambiente.','15.523.634/0001-04','contato@aquatech.bio.br','www.aquatech.bio.br','Somos uma empresa que realiza análises com qualidade, aperfeiçoamento tecnológico e comprometimento com o Meio Ambiente.                     \r\nDesempenhamos nossos serviços com Ética, Pontualidade e Comprometimento com fornecedores e clientes.                                     \r\nNossos preços são competitivos e prestamos assessoria ao cliente na interpretação dos resultados bem como no esclarecimento as Legislações vigentes.\r\nNossos Serviços:		\r\n	Análises Químicas, Físico-Químicas e Bacteriológicas em amostras de Poços Artesianos, Efluentes Industriais e Sanitários, Chorumes, Água de Reúso, Água de Chuva, Água Potável, Bebedouro, Piscina, Canteiros de Obras, Cisternas, Salobras, Superficiais, Subterrâneas, Carros Pipa, Fabricantes de Gelo, Grandes Construtoras e Outras.\r\n\r\n	Oferecemos às Indústrias Estudo de Ensaios de Tratabilidade, onde o Efluente pode ser tratado por alguns processos químicos e físicos, que consistem na simulação do tratamento mais adequado, através de equipamentos (reatores estáticos ou jar teste), onde será possível realizar ensaios simulando as várias etapas do tratamento em ciclo completo.\r\n\r\n	Consultoria em Licenciamento Ambiental (licença prévia- licença de instalação - licença de operação - outorgas - faixa marginal - desmobilização).\r\n Estamos à disposição para eventuais dúvidas e aguardamos seu contato!\r\n              QUATECH- Química e Meio Ambiente.\r\n','','','Av. Carlos Chagas Filho','Cidade Universitária.',237,3,'179.182.115.42','S','21 36848785 , 984843896','','2014-08-14 11:06:47',NULL,NULL),
