	(1406,'JR Solutions','05123333000121','fabio@jrsolutions.com.br','www.jrsolutions.com.br','Hoje somos integradores SIEMENS, prestamos serviços e comercializamos equipamentos voltados para automação industrial. Apesar de sermos OTS Siemens, atendemos todas as marcas do mercado.\r\n\r\n \r\nPossuimos uma equipe altamente capacitada para lhe fornecer:\r\n\r\nASSISTÊNCIA TÉCNICA\r\nSuporte Técnico\r\n•	Controladores Lógicos Programaveis - CLP\r\n•	Interface Homem Máquina - IHM\r\n•	Inversores de Freqüência\r\n•	Servo Driver\'s\r\n•	Redes Industriais;\r\n•	Tecnologia da Informação – TI\r\n\r\nEste suporte poderá ser:\r\nRemoto: Através de acesso on-line aos equipamentos, e ou via telefone\r\nSuporte Local: Através do deslocamento do técnico até a planta do cliente\r\n\r\nENGENHARIA DE PROJETOS\r\nJR Solutions provê consultoria para Automação Industrial, com capacitação em \r\nProjeto de Automação de Processos e Equipamentos.\r\n\r\nDefinição de Equipamentos\r\n•	Controladores\r\n•	Painéis\r\n•	Acionadores;\r\n•	Elementos Analógicos e Digitais\r\n•	Instrumentos\r\n•	ETC\r\n\r\nDefinição de Processos:\r\n•	Criação das Funções dos Processos;\r\n•	Criação de Funções de segurança, Alarmes e Intertravamentos;\r\n•	Representação e Operação do Processo ou Equipamento através de Interfaces Gráficas;\r\n•	Análises, Adequações e Alterações de Sistemas existentes;\r\n\r\nHARDWARE DE AUTOMAÇÃO\r\nSendo reconhecida no mercado como uma empresa desenvolvedora de soluções para o\r\nAmbiente industrial, oferecemos aos nossos clientes uma vasta linha de produtos, divididas em:\r\n\r\n•	Automação e Controle\r\n•	Inversores de Freqüência\r\n•	Soft Starter\r\n•	Painéis Industriais\r\n•	Componentes elétricos\r\n\r\n \r\nPAINÉIS ELÉTRICOS	\r\nA divisão de painéis tem como principal atividade a Montagem e Testes de Painéis de baixa e média tensão. \r\nDe acordo com as necessidades dos nossos clientes, visando sempre atender as normas regulamentadoras, tais como NR-10.\r\nTodos os Painéis São Montados Com Componentes de Alta Qualidade e marcas Consagradas no Mercado.\r\n\r\n \r\nREDES INDUSTRIAIS\r\nAlém do desenvolvimento de processos desde seu inicio com redes industriais de ultima geração, também\r\né possível o desenvolvimento de projetos para a atualização de redes já existentes visando flexibilidade\r\ncom baixo custo de implementação, devido a possibilidade das redes serem atualizadas separadamente.\r\n\r\n•	Profibus (DP / PA / FMS / FDL)\r\n•	Modbus (RTU / ASCII)\r\n•	ASI\r\n•	Industrial Ethernet\r\n•	Profinet\r\n•	OPC Server / Client\r\n•	MPI\r\n\r\n \r\nREPARO\r\nDevido nossa experiência ao longo de nossos 10 Anos no Mercado de Automação Industrial, possuímos um \r\nCorpo Técnico Especializado que podem auxiliar sua empresa na resolução de diversos Problemas com Manutenção.\r\n\r\nConsertos e Reparos\r\n•	Especialistas em Reparos de Equipamentos Siemens\r\n•	MasterDriver\r\n•	Micromaster\r\n•	IHMs OP / TP / MP\r\n•	S-7 200 / S-7 300 / S-7 400\r\n•	Familia S-5 100U/115U/135U/155U\r\n•	Placas de Comunicação\r\n\r\nManutenção Preventiva\r\n•	Vasta experiência em manutenção Preventiva dos Equipamentos Siemens;\r\n•	MasterDriver;\r\n•	Micromaster;\r\n•	CLP\'s;\r\n•	IHM\'s;\r\n\r\n \r\nTREINAMENTOS\r\nAtuando há mais de 10 anos no mercado, contando com uma infra-estrutura completa, profissionais certificados internacionalmente e com ampla experiência no mercado, a JR Solutions oferece à você as melhores soluções em treinamentos em Automação Industrial, com o melhor custo x benefício do mercado.\r\nAqui, na JR Solutions, você aprende com os Mestres. Nossos profissionais possuem certificação internacional, todo o know-how e experiência de campo e os melhores métodos para capacitá-lo da melhor forma, sempre!\r\nE só na JR Solutions você tem o benefício de estudar com quem é Mestre no assunto, pelo melhor valor de mercado! Você tem toda a assistência, material didático, aprende com quem é fera no assunto e ainda investe menos!\r\n\r\n•	Step 7 Standard\r\n•	Step 7 Expert\r\n•	Redes Industriais\r\n•	Control Logix 5000 Standard\r\n•	Control Logix 5000 Expert\r\n•	WinCC Scada\r\n•	WinCC Flexible\r\n•	TIA Portal V11 Professional\r\n•	Personalizados\r\n\r\n---\r\n\r\n**São mais de 10 anos de experiência acumulados em Automação**\r\n\r\nSeja qual for a sua necessidade, estamos pronto para atende-lo. E caso não haja a necessidade, peço que comente com os parceiros sobre a JR, estamos aqui para somar!\r\n\r\n    **Manutenção de Inversores de Frequência, Soft Starters, IHM\'s, CLP\'s, Fontes Chaveadas e mais**','','','Rua Maria de Jesus, 11','Tatuapé',1134,3,'189.102.177.117','S','1126733998, 11993991995','','2014-09-03 13:54:07',NULL,NULL),
