	(1463,'SOUZA PRADO ENGENHARIA','116931750001-48','contato@mspradoengenharia.com.br','www.mspradoengenharia.com.br','“MSPRADO ENGENHARIA” é uma empresa fundada em 2009, por profissionais experientes nos diversos segmentos da engenharia e construção, oriundos das maiores e mais tradicionais empresas do setor, tais como CAMARGO CORREA, BECHTEL CORPORATION, PÖYRY TECNOLOGIA, DEGREMONT, CONFAB , entre outras.\r\n\r\nAtuamos ativamente nos mais variados serviços de Consultoria, Engenharia e Gerenciamento de Empreendimentos com um variado portfólio de estudos e projetos desenvolvendo e gerenciando obras de pequeno, médio e grande porte, desde as fases preliminares de estudos até a implantação final do empreendimento.\r\n\r\nNossa equipe multidisciplinar é altamente capacitada e oferece ao mercado soluções verdadeiramente criativas, seguras e econômicas que atendem de imediato às necessidades dos nossos clientes, somado a grande experiência na realização de projetos utilizando a técnica de modelagem 3D.\r\n\r\nEm busca de modernização e evolução para o mais completo atendimento aos clientes, em abril de 2014 firmamos uma aliança com a empresa TJ Montagem, empresa fundada pelo Sr. José Enchieto em 1997 afim de atender a demanda da Rodhia, empresa na qual teve o prazer de trabalhar durante anos.\r\n\r\nHá 17 anos no mercado, a TJ Montagem Industrial destaca-se por ter sua imagem associada ao trinômio: “Qualidade, Prazo e Segurança” aprimorando assim as exigências de QSMS e adaptando-se as mais exigentes NORMAS nacionais e internacionais.\r\n\r\nTal aliança tem como objetivo oferecer soluções integradas de Engenharia, Procurement, Construção e Montagem aos clientes privados, entidades governamentais e à sociedade, deixando sempre a melhor contribuição para o desenvolvimento sustentável do país.','','','Av. Andrômeda, 3040','Bosque dos Eucaliptos',1126,21,'179.223.24.16','N','(012) 3206-9006','','2014-09-18 14:08:57',NULL,NULL),
