	(1608,'Ayrton Prata Fotografia','','gabrieladuquee@gmail.com','http://www.ayrtonprata.com/','Ayrton Prata é um fotógrafo completamente apaixonado por seu trabalho e com olhar sensível, atento aos detalhes, enquadramentos e luzes.\r\n\r\nEntende que um casamento é um momento único e, por isso, busca registrar cada momento, os olhare, sorrisos e lágrimas\r\n\r\nProcura em cada foto, em cada olhar, criar uma cena que impressione, e toque o sentimento de quem vê suas fotos.\r\n\r\nServiços Oferecidos\r\n\r\nAyrton e sua equipe fazem todo o registro fotográfico. Cobertura da cerimônia e festa do seu casamento. Todos os momentos que antecedem o “ grande dia, como o Making Of dos Noivos, o dia da noiva.\r\n\r\nAinda oferece ensaios fotográficos antes do evento, como o e-session, onde ele consegue ter o primeiro material fotográfico com os noivos, são sessões ao ar livre com o casal em um momento descontraído, fotos bem espontâneas e dirigidas previamente. Esse ensaio se torna muito importante para que o casal entenda a forma que Ayrton expressa seus sentimentos através de suas lentes.\r\n\r\nAlém da tendência \"trash the dress\", em que os noivos ainda trajados, literalmente sujam o vestido em cenas inusitadas, como na praia, campo, mar e cachoeiras.\r\n\r\nA empresa está situada em Nova Iguaçu, Rio de Janeiro e atendem em todo o Brasil. Para saber mais detalhes e reservar sua data, enviem hoje ainda uma mensagem sem qualquer compromisso.','https://www.facebook.com/ayrtonprata?fref=ts','','','Rio de Janeiro',188,14,'189.32.152.65','S','21 980552025','','2014-11-12 16:54:28',NULL,NULL),
