	(2331,'EMPRECON CONSTRUÇÕES E REFORMAS LTDA ','19777153000178','ORCAMENTOS@EMPRECON.COM.BR','WWW.EMPRECON.COM.BR','CONSTRUÇÕES E REFORMAS\r\nA Emprecon executa obras residenciais, comerciais e industriais sempre com a mesma qualidade, mantendo o foco nos custos e nos prazos, pois sabemos que o sucesso e a viabilidade dos empreendimentos estão diretamente ligados a esses indicadores. Propondo uma estrutura técnica e administrativa adequada a cada tipo de obra, executamos inicialmente um planejamento global do empreendimento, de forma a eliminarmos no canteiro de obras as “decisões de última hora” e os “desperdícios” tão comuns na construção civil. Como os desperdícios na construção geralmente significam entulho a ser retirado e depositado em outro local, entendemos que este planejamento e a consequente redução do descarte representam uma forma efetiva de ajudar a preservar a natureza.\r\nPrestamos alvenaria de todos os tipos. Com mão de obra cuidadosa e especializada, atendemos projetos de qualquer porte.\r\n\r\nOferecemos soluções em reformas que se adequam às necessidades do cliente e aos recursos disponíveis. Fornecemos acessória prévia com estudo de área e propostas que se adequá a cada situação.\r\nCABEAMENTO ESTRUTURADO\r\nProjetos e implantações para Cabeamento Estruturado CAT5E, CAT6 E CAT7, dados, voz e imagens, seguindo as diretrizes das normas nacionais e internacionais.\r\n\r\nGestão de Implantação: Atuamos na Execução de Projetos e Implantação de Rede Estruturada. Trabalhamos em Parceria com o desenvolvimento do projeto e utilizamos estratégias que economizam recursos e horas de trabalho reduzindo ao Maximo tempo de execução de forma organizada, entregando os projetos dentro dos prazos de Execução.\r\n\r\nA Emprecon possui equipamento próprio para a certificação de redes CAT5E e CAT6, com profissionais treinados,\r\n\r\n \r\ngarantimos que as instalações estejam de acordo com as normas EIA/TIA 568. Alta performance da sua rede estruturada e a validação dos principais programas de extensão de garantia, exija a certificação com equipamento devidamente atualizado e calibrado periodicamente.\r\n\r\nCompromisso com o Meio Ambiente retornamos para reciclagem todos cabos retirados das obras.\r\n','EMPRECON','','RUA FULVIO MORGANTI 154','MANDAQUI',1134,27,'189.33.205.11','S','1122326651','','2015-07-27 21:01:25',NULL,NULL),
