	(2469,'Marcenaria Thomaz - Móveis Projetados Sob Medida','22.892.972/0001-70','mtsobmedida@gmail.com','www.mtsobmedida.wordpress.com','Serviços\r\nA Marcenaria Thomaz tem como método de funcionamento e execução os seguintes passos:\r\n\r\nElaboração de Projeto: Após o cliente solicitar um Orçamento no nosso site, um projetistas da MT irá até ao cliente e irá elaborar um projeto. Esse projeto será realizado em um software profissional 3D, assim o cliente terá uma melhor noção de como o ambiente ficará depois dos móveis serem instalados.\r\nFinalização de Projeto: Após a elaboração e aprovação do primeiro projeto (Projeto Inicial) um Finalizador da MT irá realizar o Projeto Executivo. Nesse Projeto Executivo o cliente irá ter uma relação de todos os componentes que irão em cada ambiente. Tipo de madeira, medidas, pontos de elétrica e hidráulica do ambiente.\r\nEssas medidas serão tiradas por um medidor capacitado de forma ao seu projeto sair 100% adaptado ao ambiente a ser projetado.\r\nAlém do mais, uma cópia desse projeto irá ser entregue à Equipe de Montagem. Assim, a Equipe não irá fazer furos desnecessários e saberá exatamente o que fazer e onde fazer, evitando assim alongamentos no tempo de execução da obra.\r\nExecução de Projeto: No terceiro passo, e após a aprovação do Projeto Executivo, seus móveis irão ser fabricados na nossa fábrica. As peças já irão cortadas para o ambiente, uma vez mais, de forma a evitar alongamentos no processo de montagem, bem como reduzindo a necessidade de fazer cortes e recortes no ambiente, deixando-o assim mais limpo e asseado.\r\nApós o corte e filetamento das peças do seu projeto, as peças serão embaladas e enviadas para a transportadora. As peças irão ser entregues diretamente no imóvel no qual serão montadas.\r\nServiços de Montagem: O quarto e último passo é a montagem dos seus móveis. A MT possuí Equipes de Montagem própria, evitando assim o uso de mão-de-obra terceirizada. Os nossos montadores irão munidos de experiência, conhecimento e maquinário para que a montagem de seus móveis ocorra sem delongas, mas com a qualidade exigida pela MT e, claro, pelo cliente.\r\nQualquer dúvida que tenha não hesite em nos contatar.','https://www.facebook.com/marcenariaThomaz','','R: Emilia Bandeira de Mellov96','Imirim',1134,18,'187.38.122.48','S','11-9.4765-0796','','2015-09-12 11:20:40',NULL,NULL),
