ra foto ou filmagem, adequadas às necessidades específicas para captação em foto ou vídeo .\r\n\r\n\r\n                  Exposições de arte \r\n\r\nMuseografia e expografia - Projetos, instalações e montagens de ambientes para exposições de arte e objetos expositivos em geral. Equipe técnica capacitada para construções tecnicas e montagens de obras. \r\n\r\n\r\n                Cenografia para eventos \r\n\r\nSoluções em cenografia para eventos corporativos, sociais e culturais \r\n\r\n\r\n                     Cenotécnica \r\n\r\nCenotécnicos para cenografias, construções, montagens ou restaurações de estruturas existentes. \r\n','imperiocenografiaeeventos@facebook.com.br','','rua cerro cora 2207','lapa',1134,13,'191.247.228.6','S','(11) 970438093','','2015-11-04 19:32:30',NULL,NULL),
