	(2638,'Boy Viny Express','04.962.763/0001-74','boyviny@boyviny.com.br','www.boyviny.com.br','A BOY VINY EXPRESS LTDA é uma empresa plenamente equipada e preparada para atender com agilidade e qualidade as mais exigentes expectativas de seus clientes. Atendemos pessoa física e jurídica, realizando serviços de logística e transporte de cargas expressas dos mais variados tipos. Utilizamos profissionais altamente qualificados, devidamente uniformizados, treinados e habilitados. Disponibilizamos aos nossos clientes serviços de motociclistas, carro leve (Fiorino), caminhão Kia Bongo, cargas aéreas nacionais e transporte executivo.\r\nSERVIÇOS PRESTADOS: \r\n*Entrega de: Todos os tipos de correspondência, documentos, impressos, brindes, convites, medicamentos, exames para laboratórios e clinicas, entre outros;\r\n*Entregas e recolhimento de cargas rápidas, encomendas expressas em aeroportos, terminais rodoviários e outros;\r\n*Serviços externos de escritório em geral como: Pagamentos em bancos, cobranças, faturas, correio interno, entre filiais e serviços de cartório;\r\n*Distribuição de: Jornais, revista, livros, vídeos (DVDS e CDS) e assinaturas em geral;\r\n*Boy Inteligente: Pagamentos de boletos e faturas em geral, reconhecimento de firmas, encaminhamento de ofícios e relatórios em cartórios, fóruns, centrais de planos de saúde e seguradoras (Serviço Exclusivo);\r\n*Locação de Box: Boxes individuais com área para carga e descarga.\r\nVantagens de contratar a Boy Viny para terceirização de qualquer serviço oferecido:\r\n	Substituição de funcionário em férias, licenças ou faltas;\r\n	Despesas extras como 13º salário;\r\n	Custos com rescisões;\r\n	Encargos sociais;\r\n	Benefícios;\r\n	Pessoal de controle e fiscalização.\r\nNOVIDADE: Terceirização de serviços de Recepcionista e Auxiliar de Serviços Gerais. \r\nAproveite para visitar o nosso site www.boyviny.com.br e conhecer um pouco mais sobre a nossa empresa.\r\n','https://www.facebook.com/boyviny/?ref=hl','@BoyVi