	(2783,'JUMPTEC SOLUÇÕES TECNOLÓGICAS','17.678.332/0001-22','contato@jumptec.com.br','http://www.jumptec.com.br','A equipe Jumptec é formada por criativos e inovadores artistas, administradores, publicitários e desenvolvedores de T.I. especializados em web.\r\n\r\nEsse grande time foi formado ao longo de muitos anos administrando vários players na web o que revelou a competência, versatilidade e criatividade desses profissionais que conhecem cada detalhe dos procedimentos necessários para que seu site obtenha o melhor resultado.\r\n\r\nNossos objetivos\r\n\r\nNossa missão é possibilitar com que nossos clientes alcancem o nível de excelência em seu negócio na web, desenvolvendo idéias e conceitos, trazendo soluções pontuais para cada negócio e oferecendo suporte total desde o desenvolvimento até a conclusão total do projeto.\r\n\r\nAcreditamos que a Tecnologia da Informação seja um meio para as corporações atingirem seus objetivos através da operacionalização de seus processos, monitoramento de seus dados e apoio à tomada de decisão com base nas informações estratégicas e gerenciais.\r\n\r\nNosso foco principal é o desenvolvimento de soluções sob medida, específicas para o perfil de negócio de cada empresa, criadas com processos e métodos que resultam no atendimento rigoroso de prazos e custos que valorizam a qualidade do resultado final.\r\n\r\nSimuladores\r\n\r\nA Jumptec é pioneira no desenvolvimento de simuladores para qualquer produto, seja ele qual for, desde um “alfinete” até um “avião”. Os simuladores são poderosas ferramentas de conversão de vendas, pois os usuários conseguem interagir com o produto, compartilhar preview através de redes sociais, e-mail, aplicativo de mensagens instantâneas, etc.\r\n\r\nNão há limite para a quantidade de modelos que podem ser inseridos no simulador e nem a quantidade de variação de modalidades. Faça um orçamento sem compromisso!','','','Av. Batel, 1868','Batel',7273,4,'177.69.89.40','S','(41) 4141-7050','','2016-01-18 16:15: