	(2954,'SPARTA RASTREADORES','1070133000168','contato@spartarastreadores.com.br','www.spartarastreadores.com.br','Monitoramento Patrimonial\r\n\r\nRealizamos manutenções preventivas e uma sistemática de testes remotos diários, para identificar possíveis falhas nos equipamentos.\r\n\r\nCentral de Alarme\r\nAtravés dos periféricos (sensor de presença, magnético, barreira, cerca elétrica, controles remotos, etc) integrados a Central de Alarme, possibilitamos o monitoramento das áreas: Interna, Perimetral e Externa.\r\nOs Eventos gerados são transmitidos de forma instantânea a Central de Monitoramento, onde os operadores atuarão a partir de procedimentos personalizados e contarão com o apoio da Pronta Resposta em caso de Emergência.\r\n\r\nAbaixo alguns dos nossos serviços:\r\n• Central de Monitoramento 24x7;\r\n• Serviço de Manutenção Personalizado;\r\n• Controle de Acesso Identificado;\r\n• Controle de Agenda com aviso telefônico;\r\n• Pânico Silencioso e Alerta de Coação;\r\n• Relatório Mensal de Eventos;\r\n• Pronta Resposta.\r\n\r\nImagem - CFTV\r\n\r\nBaseado no projeto estabelecido, podemos utilizar a tecnologia IP ou Analógica de acordo com a necessidade, possibilitando a captura de imagens com alta definição em pontos estratégicos e viabilizando economicamente a solução.\r\nDisponibilizamos aos clientes a visualização das imagens através de: Software Local, Acesso Web ou Aplicativo para smartphones, no qual poderão controlar remotamente a operação.\r\nO Sistema de CFTV pode ser integrado a Central de Alarme, que ao notificar uma emergência permite a visualização remota do local e auxilia a Central de Monitoramento na tratativa do Evento.\r\n\r\n\r\n\r\n\r\nAbaixo alguns de nossos serviços:\r\n• Histórico de Imagens;\r\n• Serviço de Manutenção Personalizado;\r\n• Identificação de placa e motorista;\r\n• Reconhecimento Facial;\r\n• Consultoria em Central de Monitoramento Local.\r\n\r\n\r\n\r\nProteção Veicular \r\nCarteira de cliente com mais de 30 mil protegidos. 4600 acionamentos de recuperação com a perda de apenas 6 motocicletas. \r\nÚnica empresa do ramo que não enfrentou nenhum tipo de processo de Pequenas Causas ou denuncias em Procon e órgãos de proteção ao consumidor. \r\nLigue e Comprove 11 2506-5371.\r\nVANTAGENS SPARTA \r\nCentral 0800 24 horas A cobertura é em todo o território nacional. Recuperação comprovada na prática em torno de 98,5%. Relatórios diários, semanais, mensais e de até 6 meses de todos os lugares que a moto esteve, minuto a minuto.\r\nEconomia de até 70%,comparado a qualquer seguradora. Bateria backup continua funcionando mesmo sem a bateria do veiculo.\r\nNosso aparelho é blindado, a prova d\'água e anti-jammer (bloqueadores de sinal de rastreadores).\r\nO aparelho é transferível de moto para carro, ônibus ou caminhão em qualquer época. Garantia do aparelho é permanente. \r\nA instalação é feita no local indicado pelo cliente. O apoio tático é especializado em recuperação.\r\nO bloqueio e desbloqueio é feito à distância.\r\n\r\n','https://www.facebook.com/spartarastreadores','','Avenida Rio das Pedras, 219','Jardim Aricanduva',1134,4,'179.209.225.176','S','1125065371','','2016-03-14 12:44:06',NULL,NULL),
