	(3780,'Cerimonial Encante','','glauzienegoncalves@gmail.com','','Nossa equipe do cerimonial começa quando o evento ainda está no coração!\r\nA cerimonialista participa, colabora, dá sugestões. Esta pode ser a diferença entre o sucesso e alguns atropelos durante a festa, pois os homenageados/parabenizados no grande dia, estarão preocupados, e precisam como todos, se divertirem...\r\nA cerimonialista entende de todos os detalhes do evento. Durante todos os preparativos, está sempre à disposição para diminuir as dúvidas, dar conselhos, e até mesmo para resolver qualquer conflito que possa surgir.\r\nNo Casasmento:\r\nA cerimonialista também ajuda a organizar a lista de convidados e faz a confirmação de presença, que é muito importante para que tudo esteja em perfeita harmonia com o número de convidados presentes.\r\nA cerimonialista esta apta a ir ao local do evento, receber todos os serviços contratados e verificar se estão sendo feitos de acordo com o gosto dos noivos.\r\nNa hora da cerimônia, organiza o cortejo, explicando a posição de cada um no altar, tira a noiva do carro e ajeita os últimos detalhes como esticar a cauda do vestido, o véu e o posicionamento do buquê para que a noiva possa ter uma entrada triunfal!\r\nNa recepção, organiza a entrada dos noivos, fotos, abertura da pista de dança, distribuição de brindes de pista, lembrancinhas, bem-casados, hora de cortar o bolo, jogar o buquê etc...\r\nSão tantas coisas para planejar, organizar e supervisionar que não sobraria tempo para os noivos se divertirem se não houvesse a ajuda da cerimonialista.\r\nSe permita, esse é um dos dias mais especiais de sua vida! Contrate o cerimonial, e encante sua festa, oferecendo o melhor para seus convidados, e isso inclui os noivos, com toda disposição para aproveitar com disposição esse momento!\r\n\r\n','','','Não informado','Não informado',5338,13,'189.83.49.231','N','(31) 99726-1298','','2016-11-23 09:58:04',NULL,NULL),
	(3781,'CERIMONIAL ENCANTE','','glauzienegoncalves@gmail.com','https://www.facebook.com/cerimonialencante','Nossa equipe do cerimonial começa quando o evento ainda está no coração! A cerimonialista participa, colabora, dá sugestões. Esta pode ser a diferença entre o sucesso e alguns atropelos durante a festa, pois os homenageados/parabenizados no grande dia, estarão preocupados, e precisam como todos, se divertirem... A cerimonialista entende de todos os detalhes do evento. Durante todos os preparativos, está sempre à disposição para diminuir as dúvidas, dar conselhos, e até mesmo para resolver qualquer conflito que possa surgir. No Casasmento: A cerimonialista também ajuda a organizar a lista de convidados e faz a confirmação de presença, que é muito importante para que tudo esteja em perfeita harmonia com o número de convidados presentes. A cerimonialista esta apta a ir ao local do evento, receber todos os serviços contratados e verificar se estão sendo feitos de acordo com o gosto dos noivos. Na hora da cerimônia, organiza o cortejo, explicando a posição de cada um no altar, tira a noiva do carro e ajeita os últimos detalhes como esticar a cauda do vestido, o véu e o posicionamento do buquê para que a noiva possa ter uma entrada triunfal! Na recepção, organiza a entrada dos noivos, fotos, abertura da pista de dança, distribuição de brindes de pista, lembrancinhas, bem-casados, hora de cortar o bolo, jogar o buquê etc... São tantas coisas para planejar, organizar e supervisionar que não sobraria tempo para os noivos se divertirem se não houvesse a ajuda da cerimonialista. Se permita, esse é um dos dias mais especiais de sua vida! Contrate o cerimonial, e encante sua festa, oferecendo o melhor para seus convidados, e isso inclui os noivos, com toda disposição para aproveitar com disposição esse momento!','https://www.facebook.com/cerimonialencante','','Não informado','Não informado',5338,13,'189.83.49.231','N','(31) 99726-1298 / (31) 9','','2016-11-23 10:09:20',NUL