	(3886,'Pizzaria Di Napoli Atibaia','','contato@pizzariadinapoli.com','www.pizzariadinapoli.com','O Nome Di Napoli é uma homagem a cidade natal do proprietário \"Napoli\"é considerada o berço mundial da Pizza, e de lá vem a receita da massa de preparo artesanal, composta de um blend de farinhas de grãos especiais importados e nacionais, como a farinha especial \"00\"considerada \"La Farina Di Napoli\" especial para pizzas e 100% natural proporciona um excelente desenvolvimento no processo de fermentação tendo como resultado uma massa leve, crocante e saborosa.\r\n\r\nA Pizzaria Di Napoli Atibaia trabalha com um alto critério de qualidade em todos os processos de produção das pizzas. Isso começa desde a escolha dos ingredientes, somente as melhores marcas comprovadas entram na cozinha Di Napoli. Todos os produtos desde os ingredientes da massa até a cobertura, são frescos e manipulados de maneira correta, em condimentadora refrigerada, para que o produto final chegue a mesa dos clientes com o sabor maximizado e com a garantia de uma alimentação saudável.\r\n\r\nPara entregar um produto de alta qualidade a Di Napoli também tem total atenção na montagem das pizzas, até o aquecimento do nosso Forno e pensado com carinho. Mantendo sempre a temperatura ideal para que a massa asse corretamente, e para que o sabor da Itália chegue a mesa de nossos clientes','www.facebook.com/pizzariadinapoli.atibaia','','Alameda Professor Lucas Nogueira Garcez, 3985','Jardim Paulista',394,12,'181.220.178.136','N','11 2427-0550','','2016-12-27 17:50:24',NULL,NULL),
