melhoria de atendimento e para o alcance da completa satisfação de nossos clientes.\r\n\r\nNosso processo de treinamento interno, visa o desenvolvimento profissional e a conscientização de nossos colaboradores de que o atendimento deve ser caracterizado pela excelência. \r\nAtravés da afirmação desse compromisso, expressamos nosso desejo de proporcionar um atendimento que traga solução, tranquilidade e satisfação para nossos clientes.\r\n\r\nA transparência nos negócios, visa garantir uma negociação sólida e clara, proporcionando a certeza ao consumidor de que está comprando com uma empresa que busca a negociação justa, profissional e transparente.\r\n\r\n\r\nNosso compromisso com a legalidade, proporciona ao consumidor internauta a tranquilidade de que está adquirindo produtos de uma empresa tradicional e que segue rigidamente todos os princípios básicos estabelecidos pela legislação civil, comercial e fiscal brasileiras.\r\n','http://www.facebook.com.br/classeainfo','','Rua General Vitorino, 277','centro',9053,10,'187.5.199.73','N','51- 3221-9099','','2017-02-17 17:31:44',NULL,NULL),
