	(4217,'Marcenaria GMW','26111536000178','contato@marcenariagmw.com.br','www.marcenariagmw.com.br','MARCENARIA GMW | 24 ANOS DE TRADIÇÃO\r\nA Marcenaria GMW é uma fábrica de Móveis Planejados situada em São Bernardo do Campo/SP, nossa marcenaria atua no mercado moveleiro há mais de 24 anos, realizando atendimento de marcenaria em São Paulo e regiões da Grande São Paulo.\r\nA Marcenaria GMW foi fundada em 1992, e desde então vem construindo uma ótima reputação no mercado, pautada no compromisso, qualidade, ética e responsabilidade social.\r\nNossa marcenaria realiza a fabricação de móveis planejados com o que há de melhor em matéria-prima, e por tanto atuamos em parceria com os melhores fornecedores do ramo moveleiro, e assim garantimos móveis com acabamento e qualidade superiores.\r\nA Marcenaria GMW em São Bernardo do Campo/SP conta com uma fabricação própria, sendo assim a produção é realizada dentro de nosso galpão, sem que haja terceirizações ou intermediários no processo de montagem, o que garante aos nossos clientes um controle de qualidade em toda a cadeia produtiva.\r\nEm nossa fábrica de móveis planejados contamos com os melhores e mais eficientes maquinários, que permitem que tenhamos melhores cortes e acabamentos em nossos móveis.\r\nSem contar que agilizam nosso processo de produção e assim podemos ter prazos mais curtos para entrega dos móveis.\r\nTrabalhamos com diversos tipos e linhas de Móveis Planejados:\r\n–Cozinhas Planejadas\r\n–Dormitórios Planejados\r\n–Salas Planejadas\r\n–Móveis para Banheiro\r\n–Móveis para Áreas Externas\r\n–Móveis para Instalações Comerciais\r\n–Móveis para Áreas de Serviço\r\n–Closets\r\n–Home Office, e muitos outros.\r\nAcesse maiores informações em: www.marcenariagmw.com.br\r\n','https://www.facebook.com/moveismarcenariagmw/','','Avenida Senador Vergueiro, 3703','Vila América',1106,18,'143.0.58.1','N','(11) 4365-4633','','2017-03-31 02:15:28',NULL,NULL),
