	(4517,'PHJ CONSTRUÇÕES E REFORMAS EM GERAL LTDA','20138367000183','phjconstrutora@gmail.com','','Breve Histórico:\r\n\r\nDesde sua fundação no ano de 2014, a  PHJ CONSTRUÇÕES E REFORMAS EM GERAL, tem se concentrado em prover soluções diferenciadas e confiáveis, com profissionalismo, responsabilidade, criatividade, versatilidade, agregando valor aos negócios do cliente. Durante esses três anos de trabalho, adquirimos vasta experiência em todas as áreas da construção civil, limpeza e conservação em geral, e se destacando das demais do ramo em prestadoras de serviços.\r\n\r\nNossa Sede:\r\nPHJ CONSTRUÇÕES E REFORMAS EM GERAL presente fortemente em Águas Lindas de Goiás\r\n\r\nPlanejamento da Prestação de Serviços:\r\nNossos funcionários são altamente qualificados, e treinados para a função exercida. Encaminhamos todos os funcionários uniformizados, crachá com foto para fácil identificação nas dependências do local de trabalho. Fornecemos todo amparo e equipamento (quando contratado) para execução dos serviços prestados. Nossos funcionários são devidamente registrados com salário da categoria, vale refeição, vale transporte e plano de saúde. \r\n\r\nVantagem de Contratação da PHJ CONSTRUÇÕES E REFORMAS EM GERAL \r\n\r\n	Exclusão dos custos operacionais gerados por uma contratação e otimização do tempo requerido pelo recrutamento e seleção;\r\n	Maior concentração na atividade, redução dos custos administrativos e do passivo trabalhista;\r\n	Relação custo/benefício com mão de obra treinada,  produtos de qualidade e equipamentos adequados.\r\n\r\nResponsabilidade da PHJ CONSTRUÇÕES E REFORMAS EM GERAL\r\n\r\n	Substituição dos funcionários por faltas, férias e outros afastamentos;\r\n	Produtos de limpeza, máquinas e equipamentos, quando contratados;\r\n\r\nPara dúvidas ou esclarecimentos sobre está proposta ou outras informações sobre nossos serviços prestados , colocamos a disposição o Departamento de Contratos.\r\n\r\nAtenciosamente,\r\n\r\n\r\nAdriana de Sousa Sant