	(4910,'Renovo Reformas Prediais','25571696000137','renovoreformas@yahoo.com','www.renovoreformas.com','A RENOVO Reformas Prediais 31 3473-2000 | 98687-2000 | 3357-1961 | www.renovoreformas.com | Temos vários anos de experiência técnica e a responsabilidade na Segurança, Qualidade e Garantia Total de suas obras, oferecendo a melhor solução técnica resultando no melhor custo/benefício com preço Justo e competitivo. Oferece serviços de limpeza e reformas de fachadas prediais; residenciais, condomínio, prédios e empresas. Serviços de reformas com equipamentos e produtos de qualidade e profissionais treinados e adequados às normas da legislação trabalhista; Bem como de segurança do trabalho. Além dos treinamentos, os funcionários atuam com EPI\'s e equipamentos de segurança, dentro dos parâmetros legais, tudo isso com preços imbatíveis e condições de pagamento facilitadas.\r\nQuando falamos em Limpeza Reformas de Fachadas Prediais a RENOVO Reformas Prediais é uma empresa que se destaca pela qualidade no serviço, capacitação de seus profissionais e pela experiência de mercado.\r\nA RENOVO Reformas está capacitada a atender seus clientes, de forma integrada, em todas as fases de implantação da construção ou reforma com disponibilidade operacional, logística e gerenciamento total da obra.\r\nCom atuação marcante em Belo Horizonte e região metropolitana, tem executado projetos de grande importância para empresas e condomínios renomados.\r\nA sua reforma predial com sucesso começa aqui! Com uma grande oportunidade única para o seu condomínio ou empresa fazer aquela reforma ou uma simples pintura com a RENOVO Reformas Prediais!\r\nConsultoria\r\nA RENOVO Reformas conta com profissionais competentes e gabaritados para visitarem a obra, condomínio, empresas, comercial escritório ou residência com o objetivo de solucionar dúvidas dos clientes e minimizar o custo do material. Além da medição do espaço e indicação do acabamento apropriado para cada trabalho, a pedido do cliente, os profissionais prestam consultoria em cores, com sugestões baseadas nas novas tendências e harmonia das cores\r\nA qualidade é garantida por seus excelentes profissionais, que sempre trabalham com materiais de primeira qualidade, com técnicas de manuseio indicados especificamente para cada trabalho e/ou produto, sempre de acordo com as recomendações dos fabricantes e normas técnicas da ABNT (Associação Brasileira de Normas Técnica) tudo com segurança total.\r\nAo longo de 40 anos de caminhada, tornou-se a empresa de reforma predial referência em Belo Horizonte e região metropolitana,que se orgulha do que já fez e acredita sempre em tudo que planeja construir para o futuro.\r\nNosso compromisso é trabalhar respeitando e tornando único cada cliente e entendendo suas necessidades, desejos e sonhos, para melhor contribuir nas suas realizações.\r\nAs reformas e pinturas sob a responsabilidade da RENOVO Reformas Prediais apresentam elevado padrão, com qualidade total, e principalmente no que tange ao cumprimento de prazos de execução, sendo a sua equipe de funcionários bem treinada, e voltada para o bom nível de realização dos serviços prestados.\r\nA fachada é o cartão postal do seu condomínio, empresa, negócio ou lar, por isso a reforma, limpeza e revitalização é tão importante para gerar sempre credibilidade e uma boa aparência.\r\nA RENOVO Reformas Prediais garante uma reforma e limpeza completa, para deixar sua fachada sempre grandiosa.\r\nA marca da reforma e pintura predial em BH e região metropolitana é RENOVO Reformas Prediais!\r\nTenha a certeza e a garantia de quem faz desde 1978, com profissionalismo e solidez.\r\nA parceria certa para sua reforma e pintura predial em Belo Horizonte e região Metropolitana.\r\nO braço forte, e a mão amiga das empresas, condomínios e síndicos (as); na hora da reforma predial é RENOVO Reformas Prediais!\r\nEstamos alertas! Na realização de seus sonhos a reforma predial da sua empresa ou condomínio, realize seu sonho!\r\nResponsabilidade Social: Ações concretas que fazem a diferença na vida das pessoas; Trabalho pela justiça, da solidariedade e paz entre os homens\r\nPrefira RENOVO REFORMAS PREDIAIS.\r\nCerto de seu elevado espírito de justiça, aguardamos o seu contato para realizarmos um orçamento sem compromisso, desde já somos Gratos pela preferência.\r\nContate-nos para um orçamento Temos total disponibilidade de uma visita técnica para vistoriar o local da obra para melhor atendê-los, lembrando que essa visita é imediata e (SEM CUSTO). Mais informações pelo telefone 31 3473-2000 | 98687-2000 | 3357-1961 ou pelo e-mail: renovoreformas@hotmail.com\r\n','','','Rua João Ramalho, 73','Gloria',4010,3,'201.17.211.237','N','31 3357-1961','','2017-11-28 07:42:37',NULL,NULL),
	(4911,'Felipe Back','24.358.404/0001-10','protmundi@protmundi.com.br','http://protmundi.com.br/','Serviço de Protótipos, Pequena série de Peças até Produção.\r\n\r\nFornecemos qualquer tipo de protótipo nos mais diversos materiais como plástico, borracha (Flexíveis), resina, chapa de metal e fundidos), em diversas tecnologias e processos.\r\n\r\nContamos com parcerias em todo território nacional e na China.\r\n\r\nNossos serviços atendem as diversas necessidades e projetos como peças e produtos com finalidade estética ou funcional.\r\n\r\n1- Mockup / protótipo de produto para apresentação aos diretores, Marketing, Design, consumidores e etc, dos mais diversos materiais (material final, plástico, MDF, cibatool, isopor, etc); \r\n2- Fabricação de peças protótipo através de moldes e ferramentas simples/otimizadas para redução de custos para as primeiras análises. Exemplo de molde de injeção protótipo para entrega ao cliente apenas das peças injetadas. \r\n3- Usinagem em todos os materiais como ABS, Nylon, PP, Acrilico, EPS (isopor), MDF, Poliacetal, aço, FoFo, etc... \r\n4- Estampo/Repuxo de peças com ferramentas protótipo (custo e prazo reduzidos); \r\n5- Fabricação de lotes reduzidos (peças finais) mas com moldes e ferramentas otimizadas visando o melhor custo benefício; \r\n6- Peças injetadas no material final (solicitado pelo cliente); \r\n7- Pintura, acabamento e Serigrafia; \r\n8- Dispositivos de montagem e controle; \r\n9- Peças em FoFo (fundição) por exemplo para grades (trempes), chapa grill, etc; \r\n10- Dobras em metais; \r\n11- Recorte em metais; \r\n11- Prototipagem rápida (Impressão 3D); \r\n12- Gabaritos e Dispositivos.','','','rua Inambu, 350, piso inferior','Costa e Silva',9580,4,'189.7.10.35','N','(47) 3202 6028 , (47) 99631 4321 , (47) 30034 1953','','2017-11-28 08:13:33',NULL,NULL),
