	(5029,'The Friends Drink\'s','','contato@thefriendsdrinks.com.br','www.thefriendsdrinks.com.br','SOBRE NÓS\r\n\r\nEspecializados na área de prestação de serviço de bar, com toda a infraestrutura necessária para realizar qualquer tipo de comemoração. Temos como nosso maior desejo proporcionar a todos nossos clientes sempre o melhor, com preço justo, serviço diferenciado, atendimento personalizado e muita alegria por servir.\r\n\r\nTemos orgulho em dizer que somos uma empresa que apoia o consumo moderado e responsável, que possui profissionais treinados e orientados para que assim seja feito. Não disponibilizamos bebidas alcoólicas para menores de idade e por isso possuímos um cardápio de drinks não alcoólicos.\r\n\r\nSomos a The Friends Drink\'s e estamos aqui para trazer um novo conceito de bar,mostrar que o bartender é um artista,e nós possuímos, \"A arte de celebrar entre amigos\". Venha ser um apreciador desta arte, será um imenso prazer para nós.','https://www.facebook.com/thefriendsdrinks/','','Rua Barbosa Vilas Boas 401','Jardim das Flores',1134,13,'152.249.120.5','S','11948829984, 11996010824','','2018-02-06 15:20:40',NULL,NULL),
