	(5092,'Transdoor Logística e Transporte','52642980000120','transdoor@transdoor.com.br','www.transdoor.com.br','A Transdoor nasceu em 1983 para atender a demanda do mercado de transportes por agilidade nas entregas e controle de fluxo de informações.\r\n\r\nAtuando principalmente na distribuição de material promocional e ações de marketing, a Transdoor atende as maiores agências de publicidade do país e mantem um ótimo relacionamento com fornecedores, gráficas e exibidoras em todo Brasil.\r\n\r\nTambém atendemos empresas que atuam em outros ramos e atividades e que necessitam de agilidade na distribuição e acompanhamento de seus produto.\r\n\r\nTransporte aéreo e rodoviário \r\n\r\nAtendemos todos os municípios do Brasil com os melhores prazos do mercado.\r\n\r\nNo transporte aéreo, a Transdoor trabalha com todas as companhias em sistema de embarque primeiro vôo/prioridade.\r\n\r\nNos destinos, disponibilizamos de veículos que aguardam o pouso das aeronaves e, assim que a carga é liberada, efetuam as entregas de forma rápida e segura. Ainda nessa modalidade, efetuamos entregas internacionais e exportações de pequenos volumes e amostras.\r\n\r\nRealizamos coletas em diversas cidades com redespacho para qualquer destino oferecido pela malha aérea.\r\n\r\nNo transporte rodoviário proporcionamos os melhores prazos de entrega e custo.\r\n\r\nO seu material pode viajar como carga fracionada com ótimo custo x benefício ou para pequenos prazos ou grandes volumes oferecemos a alternativa de carros exclusivos para entrega direta.\r\n\r\nColetas e entregas\r\n\r\nA Transdoor trabalha com o sistema de solicitação de coletas. Enviamos um de nossos carros imediatamente após seu chamado ou agendamento de coleta. O mesmo procedimento é adotado com as entregas: seu material seguirá diretamente para o destino o mais rápido possível ou com agendamento de horário.\r\n\r\nAs coletas podem ser solicitadas em qualquer cidade atendida pela Transdoor e então despachadas para outros destinos.\r\n\r\nCaso exista a necessidade, disponibilizamos veículos para atendimento de sua demanda 24 horas por dia, 7 dias da semana.\r\n\r\nA chamada entrega \"porta a porta\" continua sendo uma de nossas especialidades. Com vasta\r\n\r\nexperiencia nesse tipo de entrega, a Transdoor se estabeleceu no mercado como uma das mais competentes operadoras na distribuição de campanhas para grandes varejistas e lojas de franquias espalhadas pelo Brasil.\r\n\r\nA Transdoor também faz distribuição \"em mãos\" de mala direta, brindes, presentes e convites.\r\n\r\nLogística e manuseio\r\n\r\n A Transdoor oferece o serviço de logística e manuseio inclusive com espaço para armazenamento do seu material em galpão monitorado 24 horas por dia.\r\n\r\nRetiramos seu material nos fornecedores e efetuamos: contagem, separação, etiquetas personalizadas e etc. Elaboramos ainda montagem de kits e embalagens especiais conforme especificações.\r\n\r\nTodos esse processo é monitorado passo a passo para que o cliente tenha conhecimento e acompanhe em tempo real em qual fase do processo seu material se encontra. \r\n\r\nA distribuição segue monitorada e protocolos de entrega garantem o controle das informações de recebimento no destino final.','https://www.facebook.com/transdoortransporte/','','R. Almansa, 147','Morumbi',1134,2,'189.121.196.226','N','11  37469000','','2018-03-01 13:36:09',NULL,NULL),
