	(5131,'A OFICINA DE EVENTOS LTDA-ME.','17.504.434/0001-21','t4m@t4m.com.br','','Abaixo deixo um breve descritivo de algumas de nossas atuações dentro do Mercado Corporativo, nos especializamos ao atendimento de Construtoras e Incorporadoras, \r\n\r\nGostaria de agendar uma reunião sem compromisso, para melhor apresentar nossa Empresa.\r\nDesde já agradeço a atenção\r\n\r\nAtt Mylena \r\n\r\nBreve relato de nossa atuação:\r\n\r\nAOficina de Eventos é uma das empresas do Grupo T4M que atua a 10 anos desenvolvendo soluções para eventos!\r\nNos tornamos especialistas no segmento Imobiliário, Empresarial, Publicitário, e Treinamentos, atendemos Construtoras, Empresas e Agencias em todos os segmentos.\r\nEntendemos que o mercado é extremamente dinâmico, corrido, necessita de parceiros dispostos a atender suas reais necessidades \r\ndentro de prazos muito curtos.\r\n\r\nAbaixo cito trabalhos realizados por nós;\r\n\r\nSonorização, Projeção, Iluminação\r\nFeiras\r\nBrindes para clientes e colaboradores\r\nCompra de material\r\nFestas de confraternização\r\nCampanhas de incentivo\r\nTradução simultânea\r\nCoffe-Break, Brunch\r\nRecepção\r\nAssembleia\r\nConfecção de material publicitário e banners\r\n\r\nEstudamos cada detalhe para buscar a melhor solução e viabilizar custos.\r\n\r\nA T4M, matriz do grupo, atua no segmento tecnológico, o que viabiliza uma infraestrutura ainda melhor em eventos como:\r\n\r\nSistema de telefonia voip\r\nwi-fi\r\nSistema de Monitoramento em tempo real\r\nGeradores\r\nSonorização ambiente\r\nControle de acesso\r\nPainéis de Led\r\nAr condicionado\r\nTendas\r\nCriação de salas especiais para apresentação de produtos\r\n\r\n\r\n\r\n\r\n\r\n','https://www.facebook.com/AOficinaDeEventos/?ref=br_tf','','Rua: Ribeirão Pires, 127','Nova Petrópolis ',1106,13,'200.168.13.69','S','(11) 3939-0807','','2018-03-13 10:13:28',NULL,NULL),
