	(5166,'A OFICINA DE EVENTOS E PROMOÇÕES','17.504.434/0001-21','t4m@t4m.com.br','','A Oficina de Eventos é uma das empresas do Grupo T4M que atua a 10 anos desenvolvendo soluções para eventos!\r\nNos tornamos especialistas no segmento Imobiliário, Empresarial, Publicitário, e Treinamentos, atendemos Construtoras, Empresas e Agencias em todos os segmentos.\r\n\r\n\r\nAbaixo cito trabalhos realizados por nós;\r\n\r\nSonorização, Projeção, iluminação, feiras,\r\nBrindes para clientes e colaboradores, compra de material, festas de confraternização, campanhas de incentivo, tradução simultânea, coffe-Break, brunch, recepção, assembleia, confecção de material publicitário e banners.\r\n\r\nEstudamos cada detalhe para buscar a melhor solução e viabilizar custos.\r\n\r\nConfira nossos preços e serviços diferenciados no mercado e com alto padrão de qualidade, que só a OFICINA sabe oferecer para você.\r\n\r\nCerto de sua atenção, fico no aguardo para marcar uma visita e discutirmos possibilidades.\r\n','https://www.facebook.com/AOficinaDeEventos/','','Rua: Ribeirão Pires, 127','Nova Petrópolis ',1106,13,'200.168.13.69','N','11 3939-0807','','2018-04-03 09:16:52',NULL,NULL),
