	(5396,' HEMPLAST','13320886000100','vendas@hemplast.com.br','www.hemplast.com.br','HEMPLAST - FABRICANTE DE PRODUTOS PARA SEGURANÇA DO TRABALHO, BRINDES PERSONALIZADOS, COMUNICAÇÃO VISUAL,  SINALIZAÇÃO INDUSTRIAL, SERVIÇOS DE CORTES ESPECIAIS, SUPRIMENTOS GRÁFICOS, ENTRE OUTROS.\r\n\r\nBuscamos inovação contínua no processo de fabricação, além de atendimento diferenciado, visando à otimização de custos e a satisfação total dos nossos clientes com produtos de alta qualidade, como: \r\n\r\nACESSÓRIOS PARA EPI ́S\r\nBolsas para EPI’s, sacolas de ferramentas, sacolas para KIT carreteiro / motorista, malotes, pochetes para máscara de segurança, porta luvas, capas PT (permissão de trabalho / serviço) capas para extintores, capas para equipamentos (sob medida), capas para paquímetro / diphoterine, capas para maca de emergência / hospitalar, porta chave catraca em couro, baldes de lona para içar ferramentas, coletes refletivos, cones para birutas de sinalização do vento (sob medida), blusões de proteção para jateamento, aventais, coletes de moto táxi / moto frete, etc.\r\n\r\nCOMUNICAÇÃO VISUAL & SINALIZAÇÃO\r\nDe mãos dadas com a tecnologia, desempenhamos trabalhos de excelência, desde a fabricação até a instalação de: fachadas comerciais, adesivos, banners, cavaletes, placas de sinalização, plotagens veiculares, lonas de impressão digital, quadros, letras caixa, etc.\r\n\r\nSERVIÇOS DE CORTE EM MÁQUINA ROUTER CNC\r\nRealizamos corte em diversos materiais com precisão, rapidez e qualidade. (ideal para trabalhos de usinagem em: madeira, MDF, PVC expandido, ACM, XPS, chapa de alumínio, entre outros materiais semirrígidos).\r\n\r\nBRINDES PERSONALIZADOS\r\nBolsas promocionais, mochilas, pastas, porta tênis, nécessaires, estojos, bolsas térmicas, bolsas de viagem e outros itens personalizados que ajudam na divulgação da sua marca e fidelização de clientes.\r\n\r\nTemos como objetivo surpreender nossos clientes com produtos de alto desempenho, criando uma experiência única, pela qualidade, grande variedade e preço acessível.\r\n\r\n','','','AVENIDA LESTE QUADRA D LOTE 02','POLOPLAST',1729,7,'177.85.92.254','S','7136217239','','2018-08-16 16:32:40',NULL,NULL),
	(5399,'Tozzetto Vidros e Cristais de Segurança Ltda','','tozzetto@hotmail.com','https://www.facebook.com/tozzetto.vidros','A Tozzetto Vidros , é uma empresa fornecedora de vidros e cristais de segurança, incluindo serviços de projetos, medição e instalação. \r\n\r\nDesde 1985, tem desenvolvido parcerias estratégicas com seus fornecedores, estabelecendo e perseguindo cuidadosamente as metas planejadas nos seus diversos nichos de atuação no mercado de vidros, e sempre procurando entender e atender as necessidades de seus Clientes, focando principalmente o aspecto gerencial do negócio. \r\n\r\nNossa equipe de mão de obra, constantemente treinada, ágil e eficiente está empenhada em oferecer produtos da mais alta qualidade agregados à excelência e eficácia nos serviços de instalação e ajuste das soluções oferecidas pela empresa.\r\n\r\nApresentamos abaixo, alguns dos produtos que trabalhamos:\r\n\r\nProdutos Básicos:\r\n\r\nVidros temperados ( forno horizontal ) \r\nVidros laminados planos e curvos \r\nVidros laminados refletivos de alta performance\r\nVidros serigrafados Screen-Line \r\n\r\nProdutos Diferenciados: \r\n\r\nSliding Door – Sistema de portas de correr em vidro temperado para salas de estar em prédios residenciais \r\n\r\nAll Door – Sistema de portas de correr c/ abertura total do ambiente \r\n\r\nGC-Glass – Guarda-corpo de alumínio c/ vidro laminado para varandas em prédios residenciais.\r\n\r\nEm conjunto com a Tozzetto Vidros, temos também a Tozzetto Design que atua na área de Projetos, Construções, Ampliações e reformas. \r\n\r\nNossa postura tem sido a busca incessante da proximidade de Clientes, dispostos a desenvolver parcerias duradouras, cujo pilares fundamentais estejam sustentados nos princípios da seriedade e comprometimento.\r\n\r\nPrezado Cliente esperamos tê-lo em breve como parceiro, e agradecemos pela sua especial atenção na visita ao nosso espaço no Facebook.\r\n\r\nAtenciosamente,\r\n\r\nTozzetto Vidros e Cristais de Segurança Ltda.\r\nTo