	(5458,'Concrelit - Aluguel de Caminhão Betoneira','05434224000125','contato@concrelit.com.br','www.concrelit.com.br','A história da CONCRELIT começou em 2002. Há mais de uma década no mercado da construção civil, a empresa atende o território nacional.\r\n\r\nDesde o início de suas atividades, preocupada com o atendimento responsável e transparente da sua clientela, destaca-se pela agilidade na prestação dos serviços que oferece, garantindo a resistência e manuseio adequado do concreto usinado, considerando não só as restrições geográficas locais, como a perecibilidade do produto.\r\n\r\nEm 2007, com o investimento na aquisição de novos equipamentos, a Concrelit ampliou sua área de atuação, passando a atuar desde 2010, também no segmento de aluguel de maquinário em âmbito nacional: caminhões betoneira, bombas de concreto, caminhões basculante e vibradores de imersão.\r\n\r\nCom reconhecimento pela notória excelência de atuação no setor, atualmente é reconhecida pela qualidade no atendimento e agilidade no processo de contratação e mobilização.\r\n\r\nNossos principais valores são: Responsabilidade, Transparência, Honestidade, Confiança e Comprometimento.','https://www.facebook.com/Concrelit','https://twitter.com/concrelit','MARIA DIAS BARBOSA 130','PEREQUE',680,27,'201.55.85.134','N','1238965550','','2018-10-09 11:26:00',NULL,NULL),
