	(5478,'O Visual Projetista','3024983600195','lucashungueri@gmail.com','www.ovisualprojetista.com','Lucas Hungueri, belo horizontino de berço e Designer atuante há cerca de 5 anos no mercado gráfico. Com uma ampla experiência nas mais diversas áreas (do projeto à pré-impressão) estou pronto para deixar o seu negócio com o visual necessário para melhor atender seus clientes e fazer com que você tenha destaque no mercado, trazendo unidade visual à sua marca, que por sua vez a torna pregnante. Ou seja, faz com que as pessoas a reconheçam com mais eficiência.\r\n\r\n​\r\n\r\nOs projetos visuais atendem das coisas mais simples, como por exemplo um cartão de visitas, até os mais complexos como propostas de revitalização de fachadas, branding e visual merchandising. Com um refinado senso estético e bom gosto nas escolhas, estou pronto para atender qualquer projeto ligado a estética visual de uma marca.\r\n\r\n​\r\n\r\nBasicamente, trabalho o processo de comunicar visualmente. Essa comunicação pode ser através de imagens, textos e desenhos, utilizando habilidades em estética, artes visuais, diagramação e, principalmente, criatividade. Meu trabalho está inserido em nosso cotidiano através de marcas, símbolos, logotipos, embalagens, livros, jornais, placas, anúncios, camisetas, softwares, sites, jogos e tudo o mais que possa comunicar. Ou seja, nós designers estamos presentes em grande parte do que se vê, escuta ou toca.','https://www.facebook.com/ovisualprojetista','','Rua Jequeri, 100','Lagoinha',4010,5,'201.80.147.94','S','31994301315','','2018-10-30 18:03:02',NULL,NULL),
