	(5586,'Cone Chinês Limpeza de Ouvidos','','limpezadeouvidos@gmail.com','http://conechines-deschmitz.com.br/venda-de-cone-chines-cone-hindu-vela-hopi-vela-indiana-','CONE CHINÊS LIMPEZA DE OUVIDOS - CONE HINDU LIMPEZA DE OUVIDOS, VELA HOPI LIMPEZA DE OUVIDOS, CANUDO DE CERA LIMPEZA DE OUVIDOS\r\n\r\nFabricação e Comércio de Cone Chinês, Cone Hindu, Vela Hopi, Canudo de Cera, Vela indiana, canudo de Limpar Ouvidos\r\n\r\nProduto Artesanal -  vendas no local e venda pelo correio -  Preço especial para terapeutas da área.\r\n\r\nBenefícios Terapêuticos dos Cones Chineses ou Cones Hindus:\r\nAcalma o sistema nervoso.\r\nAtiva a circulação nos ouvidos.\r\nDesintoxica os sínus.\r\nDesobstrui o ouvido, nariz e garganta.\r\nEstimula o SNC proporcionando clareza na audição e na visão, melhorando o paladar e o olfato.\r\nFortalece o sistema imunológico.   \r\nLIMPEZA DE OUVIDOS SÃO JOSÉ SC FLORIANÓPOLIS PALHOÇA BIGUAÇU ANTONIO CARLOS SC TIJUCAS ITAPEMA BALNEÁRIO CAMBORIÚ.   .VENDA DE CONE CHINÊS, CONE HINDU, VELA HOPI, CANUDO DE CERA PARA LIMPEZA DOS OUVIDOS – PREÇO ESPECIAL PARA TERAPEUTAS\r\nCone Chinês - Cone Hindu - Vela Hopi - Canudo de Cera Parafina para Limpeza de Ouvido - Atendimento e Venda - São José SC - (48) 3094-5746 - Whatsapp  (48)  99131-9240 - Dé Schmitz Terapeuta - Venda de Cone Chinês, venda de cone hindu, venda de vela hopi, venda de canudo de parafina, venda de canudo de cera para limpeza de ouvido - CONE HINDU OU CONE CHINÊS 1)  Método Natural de Limpeza e Desobstrução de Ouvido, Nariz e Garganta INFORMAÇÕES GERAIS A limpeza do ouvido utilizando o Cone Chinês é uma técnica da medicina oriental muito conhecida  e utilizada na desobstrução de ouvido, nariz e garganta.  Nesse tipo tratamento,  coloca-se a parte mais fina do cone na entrada do ouvido, acendendo-se em seguida a outra extremidade. A medida o fogo vai consumindo o oxigênio contido no interior do cone, inicia-se uma suave  aspiração (pressão negativa gerada pelo vácuo).   A força suave de sucção mobiliza o cerume e muco acumulados nas passagens internas do ouvido, nariz e garganta (essas áreas são todas interligadas). A mobilização de cerume e muco desobstrui as passagens internas, ajudando assim o organismo a se auto-regular.  O tratamento traz benefícios reais em diversos problemas respiratórios (rinite, sinusite, alergias), na falta ou diminuição de audição, zumbidos nos ouvidos , tonturas, labirintite, enxaquecas  (causadas pela pressão auricular). Cone Chinês ou Hindu - Rinite, sinusite, alergias - Clínica de Massoterapia em São José - Centro (SC) O cerume (cera de ouvido) pode obstruir o canal auditivo, causando prurido, coceira, dor e perda auditiva temporária.  O cerume, é composto de descamação, de secreção sebácea e do produto de glândulas cerimoniosas. A cera de ouvido é produzida na porção do \"canal auditivo\" mais próxima do orifício onde ficam os \"pelinhos\" e desempenha um papel profilático e protetor, no sentido de aglutinar e reter partículas estranhas , fungos e bactérias. O técnica do Cone Hindu ou Cone Chinês faz parte da medicina popular muito antiga, que recentemente foi redescoberto e muito utilizado em países da Europa e nos Estados Unidos.  O Cone tem propriedades terapêuticas na limpeza do ouvido, desobstrução dos canais auditivos, além de evitar males como infecções. O tratamento com os cones chineses além da parte física, também promove um reequilíbrio sensorial e emocional, trazendo à tona a sensibilidade. Eles apuram os sentidos – depois do tratamento, há uma melhora na visão, olfato, paladar, audição, além do reequilíbrio emocional... Cone Chinês ou Hindu - Limpeza de Ouvido - Clínica de Massoterapia em São José - Centro (SC) INDICAÇÕES: Podem ser usados por bebes, crianças e adultos, desde que aplicado pelo profissional habilitado. Indicações para a utilização dos Cones Chineses: Alergias respiratórias. Excesso de cerúmen. Excesso de mucosidade (ouvido, nariz e garganta). Labirintopatia.(labirintite) Perda de audição por bloqueio de secreções. Dores de cabeça e enxaquecas. Estados de gripais. Otalgias. Perda de audição por bloqueio de secreções. Zumbidos e vertigens. Sinusite aguda ou crônica. Redução olfativa. Tonturas sem causas definidas. Insônia. Ansiedade, estresse, nervosismo. Síndrome de Meniére. Tensão nervosa. CONTRAINDICAÇÕES: Processos cirúrgicos recentes, tímpano danificado ou estourado, cisto nos ouvidos, mastoidite, corrimentos,  osteosclerose, perda de audição congênita, tumores no ouvido. Cone Chinês ou Hindu - Labirintite, cefaleias - Clínica de Massoterapia em São José - Centro (SC) Benefícios Terapêuticos dos Cones Chineses:  Benefícios Terapêuticos dos Cones Chineses ou Cones Hindus: Acalma o sistema nervoso. Ativa a circulação nos ouvidos. Desintoxica os sínus. Desobstrui o ouvido, nariz e garganta. Estimula o SNC proporcionando clareza na audição e na visão, melhorando o paladar e o olfato. Fortalece o sistema imunológico. Cone Chinês ou Hindu - Limpeza de Ouvido - Clínica de Massoterapia em São José - Centro (SC) DÉ SCHMITZ  - ATUA COM TERAPIAS ALTERNATIVAS DESDE 1996 ENDEREÇO DE ATENDIMENTO: Rua Arnaldo Bonchewitz, 29 - Centro - São José (SC) INFORMAÇÕES E AGENDAMENTO DE HORÁRIO: (48)   3094-5746 (48) 99678-7801 (TIM) (48) 99131-9240  (VIVO e Whatsapp) - Cone Chinês - Cone Hindu - Vela Hopi - Canudo de Cera Parafina para Limpeza de Ouvido - Atendimento e Venda - São José SC    -    (48) 3094-5746    -    Whatsapp  (48)  99131-9240     -      Dé Schmitz Terapeuta\r\nDé Schmitz – São José SC – Limpeza de Ouvidos  e venda de Cone Chinês – Cone Hindu – Vela Hopi – Canudo de Cera Parafina para Limpeza de Ouvido – Atendimento e Venda – São José SC – (48) 3094-5746 – Whatsapp  (48)  99131-9240 \r\nLIMPEZA DE OUVIDOS SÃO JOSÉ SC FLORIANÓPOLIS PALHOÇA BIGUAÇU ANTONIO CARLOS SC TIJUCAS ITAPEMA BALNEÁRIO CAMBORIÚ.   .VENDA DE CONE CHINÊS, CONE HINDU, VELA HOPI, CANUDO DE CERA PARA LIMPEZA DOS OUVIDOS – PREÇO ESPECIAL PARA TERAPEUTAS\r\nDÉ SCHMITZ  – ATUA COM TERAPIAS ALT