	(5860,'Souza Investigações','03178009000185','celularespiaoatendimento@gmail.com','https://rastreador-celular.com/','Saiba tudo sobre Rastreamento de celular. Saiba como rastrear um celular sem precisar ter acesso ao aparelho. Saiba como rastrear o Whatsapp do celular a distância. Saiba como fazer um rastreamento do Facebook e de mensagens de texto. Através do rastreamento do celular você pode realizar uma investigação completa da pessoa, sabendo seus segredos mais ocultos.\r\nAtravés do rastreamento do celular da pessoa investigada, muitos casos de infidelidade conjugal são esclarecidos porque os amantes sempre se comunicam através de telefonemas, mensagens de texto ou mesmo Whatsapp.\r\nAo acessar nosso site você saberá até mesmo como conseguir gravar as ligações telefônicas da pessoa que você deseja investigar e receber estas gravações por e-mail.\r\nVários casos de roubos e furtos dentro de empresas são descobertos através do rastreamento de mensagens de texto e gravações das ligações telefônicas.\r\nDurante muito tempo saber o que o outro falava ao celular foi o desejo de muitas pessoas que queriam descobrir traições e monitorar funcionários.\r\nAtualmente você pode instalar programas espiões que revelam toda comunicação da pessoa investigada.\r\n','','','RUA GUARARÁ, 529','Jardim Paulista',1134,6,'191.189.69.242','S','(11) 4063-4262','','2019-07-22 23:31:43',NULL,NULL),
	(5861,'Paulo Souza','','contatorastreadorcelular@gmail.com','https://descobrirtraicao.com/','Uma traição pode ser descoberta de várias maneiras.  Uma traição pode ser descoberta de maneira involuntária do tipo alguém denunciando a pessoa anonimamente a pessoa traida, ou as vezes algum amigo incomum da pessoa que trai revela a parta traída ou mesmo por uma coincidência de estarem em locais próximos e se esbarrar com o infiél em uma balada.\r\n\r\nO certo é que ninguém gosta de ser traído e neste site nós iremos ensinar as formas de se descobrir se está sendo traído na parte afetiva pelo companheiro(a) ou mesmo descobrir um funcionário ou parente próximo.  Muitas vezes um filho pode estar se envolvendo com drogas e trazendo riscos a família.  \r\n\r\nMuitas famílias se deterioram por causa que os pais deveriam agir a tempo na investigação dos filhos para saber o que eles faziam de errado e não o fizeram. Quando se dão conta, o trabalho é muito maior para reparar o que foi destruído, já houveram danos irreparáveis e se dão conta de que o filho está envolvido com entorpecentes e isso as vezes pode afetar o resto de suas vidas.\r\n\r\nDa mesma maneira, um empresário pode descobrir o que seus funcionários realizam de tarefas e monitorá-las de forma discreta e imperceptível.\r\n\r\nPor isso, acesse o nosso site e saiba a um custo ínfimo, o que fazer para descobrir tudo sobre filhos, companheiros, funcionários entre outras pessoas.\r\n','','','RUA GUARARÁ, 538','Jardim Paulista',1134,6,'191.189.69.242','S','(17) 99200-2048','','2019-07-22 23:39:52',NULL,NULL),
	(5862,'Vip - Detetives Particulares','02.986.132/0001-60','brasildetetiveparticularespiao@gmail.com','https://www.detetive-particular-brasil.com.br/','Agência Vip Detetive Particular-  Somos uma agência de detetives devidamente cadastrada como empresa de investigações.  Nossos sérvios englobam investigação conjugal, investigação empresarial, investigações virtuais, localização de pessoas e bens, investigação de pirataria e investigação política.   Na investigação política temos como descobrir desvios como compra de votos empresas laranjas em nome de terceiros, tráfico de influência entre outros delitos.\r\nNa investigação conjugal, nossa agencia de detetives pode comprovar a traição através de flagrante de adultério, gravações telefônicas, filmagens, conversas de Whatsapp entre outros.\r\nLocalização de pessoas através de telefones numero de cpf, nome completo.   Localizamos bens imóveis e ocultos\r\n','','','Avenida Eusebio Matoso, 650','Pinheiros',1134,6,'191.189.69.242','S','(11) 98668-1508','','2019-07-22 23:42:23',NULL,NULL),
