	(5928,'Escola Fabio Vicentini treinamento para habilitados','','fabiovicentini1967@gmail.com','','Treinamento para habilitados. Santos (13) – 99787-8976. (vivo ). Localiza-se no litoral sul. Entrar em contato com fabio vicentini escola fv. Fabio vicentini treinamento para habilitados. Atendemos: cubatão – santos – são vicente – praia grande – mongaguá. Hoje em dia é comum a figura do personal trainer, aquele profissional que ajuda pessoalmente e quase que diariamente o cliente a manter sua forma física. Mas o que pouca gente conhece é o serviço de personal driver. Este é o trabalho realizado pelo instrutor fábio vicentini. O curso é voltado para pessoas que tem algum tipo de dificuldade, falta de confiança ou restrição para dirigir. O serviço é pioneiro e exclusivo na região metropolitana de São Paulo. As aulas são individuais e o instrutor busca o aluno em casa, no trabalho ou onde ele estiver para todas as atividades. No início do curso o instrutor avalia a habilidade do aluno e a partir daí desenvolve o melhor planejamento de trabalho, que inclui noções básicas de dirigir, situações do dia-a-dia e viagens em auto-estradas. Ao final do acompanhamento do personal driver, o aluno estará totalmente apto a enfrentar o trânsito das maiores metrópoles, bem como realizar grandes viagens com tranqüilidade e segurança. é importante lembrar que o aluno precisa ser habilitado e o curso não substitui as aulas obrigatórias e todo o processo para adquirir a habilitação. O programa de personal driver segue o nome bem à risca. Todas as aulas acontecem no sistema de delivery class, no qual o instrutor vai ao encontro do aluno, onde quer que ele esteja. O curso é tão personalizado que é o próprio cliente quem faz o seu horário. Para que o curso seja mais produtivo é fundamental que o aluno se sinta à vontade para aprender com naturalidade. Fábio vicentini dá toda a estrutura necessária com carros que possuem ar-condicionado, direção hidráulica e sempre uma música relaxante no CD player. Além da estrutura diferenciada no sistema de aulas e nos carros utilizados no curso, outra grande diferença entre o serviço de personal driver e as tradicionais aulas para habilitados é a didática. Transmitindo sempre calma e tranqüilidade, fábio vicentini passa o conteúdo das aulas com clareza e precisão aos alunos. A aprovação até hoje é de 100%. O acompanhamento do personal driver tem carga de 10 horas-aulas, distribuídas conforme a disponibilidade e necessidade do cliente. O curso é dividido em três partes: técnicas básicas de direção, reprodução das situações do dia-a-dia e desenvolvimento de técnicas em estrada. Assim como numa avaliação física, vicentini usa as primeiras aulas para enxergar como está a dirigibilidade do aluno e então fazer uma programação mais adequada a cada um. No início o personal driver desenvolve o controle dos pedais e a técnica de dirigibilidade do cliente. Estes fatores geram mais controle, segurança e facilitam a condução do veículo em situações comuns, como subidas, retomadas, contorno de curvas, desvios, mudanças de faixas e ultrapassagens. Após afiar a técnica para condução do veículo, o aluno passa a simular as situações que encontra no seu dia-a-dia, para se familiarizar e não ser pego de surpresa. Esta consiste em idas ao supermercado, à faculdade, ao shopping ou ao trabalho. Preparado para enfrentar o trânsito de uma metrópole, o aluno chega à fase final, que é aplicar seus conhecimentos na estrada. O encerramento é uma viagem, no carro do cliente, ao litoral sul de São Paulo, passando por praia grande, são vicente – com parada no topo da ilha porchat – e santos. Os alunos da baixada sobem a serra indo até São Paulo. Fábio vicentini está ligado com educação ao volante há mais de 15 anos. Ele iniciou seu trabalho como instrutor em 1996, dando aulas para futuros pilotos de carros e de motos. Neste mesmo ano ele fez parte da equipe de resgate do gp Brasil de fórmula 1. Faz parte do ceoc. Centro de exelência de oficiais de competição reconhecida pela fia. Em 1996 vicentini iniciou seu trabalho como instrutor de direção defensiva e instrutor de teste driver (função exercida na bmw e na volvo, gm, bmw, Ford, kia e em 1998 passou a realizar o xclusivo serviço de personal driver. Ele também atua como piloto e instrutor de test drive, tanto de motocicleta quanto de carros. Atualmente também ministra aulas práticas de pilotagem competitiva na alpie – escola de pilotagem, no autódromo de interlagos, em São Paulo…\r\nCONTATO: (13) 99787-8976.zap','','','Praia Grande','Cidade Ocian',993,25,'191.205.231.240','S','13997878976','','2019-09-13 12:37:07',NULL,NULL),
