	(6001,'Zebron do Brasil Ind. e Com. Ltda - Pinhais PR','','carlos.palma@zebron.com.br','www.zebron.com.br','Gostaríamos de apresentar e solicitar nossa inclusão em seu cadastro técnico de produtos de impermeabilização de lajes, de tubulações, de revestimentos internos de tanques de água potável e revestimentos internos em tanques de efluentes domésticos e industriais (aço carbono e concreto).\r\n \r\nAgradecemos por seu possível interesse no Sistema Zebron.\r\n \r\nA seguir faremos uma breve apresentação de nossa empresa e tecnologia, acompanhada dos materiais em anexo. \r\n \r\nA ZEBRON é uma empresa fundada nos EUA em 1969, referência em Sistemas de Impermeabilização e Revestimentos a base de Poliuretano.\r\nPresente no país desde 2008, a fabricação dos Revestimentos Zebron é 100% realizada no Brasil.\r\n \r\nO produto permite ampla aplicação nos setores de: \r\nSaneamento | Tubulações | Energia Elétrica |Cervejarias, Laticínios e Indústrias em geral | Indústrias Farmacêuticas e Hospitalares em geral  | Óleo & Gás | Mineração | Portos & Naval | Construção Civil\r\nOs revestimentos protegem novas instalações e recuperam estruturas danificadas por condições adversas.\r\n \r\nAtuamos principalmente na IMPERMEABILIZAÇÃO, REABILITAÇÃO e PROTEÇÃO ANTICORROSIVA de Estruturas de Concreto e Metal, tais como:\r\n•         Estações de tratamento de água,\r\n•         Estações de tratamento de esgoto e outros efluentes,\r\n•         Reservatórios de água potável,\r\n•         Bacias de contenção,\r\n•         Tubulações de água e esgoto,\r\n•         Poços de visita (PV) & Caixas VRP,\r\n•         Adutoras, Comportas, Condutos Forçados e Canais de Adução,\r\n•         Barragens a montante,\r\n•         Lajes de concreto & Coberturas prediais,\r\n•         Tanques & Silos,\r\n•         Entre diversas outras estruturas,\r\n \r\nPossuímos um grande histórico de obras com sucesso no Brasil, com mais de 15 anos de durabilidade comprovada, sem necessidade de manutenções periódicas e outros casos com mais de 30 anos ao redor do mundo.\r\n \r\nO Poliuretano Zebron foi escolhido para proteger interna e externamente 83 quilômetros de grandes tubulações de água bruta e tratada do Sistema Produtor São Lourenço, da Sabesp - São Paulo... maior obra hidrográfica do país.\r\n \r\nDentre nossos principais clientes, podemos destacar:\r\nAjinomoto Brasil Ltda, Ambev Ponta Grossa PR, Uberlândia MG e várias plantas, Brookfield, Boticário – Curitiba PR, Cemig (várias hidroelétricas), Cervejaria Cidade Imperial S/A – Frutal MG (executado em Nov/2019), Copel, Copasa – MG (várias unidades), Coca-Cola Femsa, Cervejaria Heineken, Cia Cigarros Souza Cruz – Uberlândia MG (2006), Hydrostec, Itaipu Binacional, JBS S/A Foods – várias plantas, Klabin Papel e Celulose, Natura Cosméticos, Nestlé Purina® – Ribeirão Preto SP, Sabesp - SP, Sanepar - PR, SAAE – Itaúna MG (em execução), SAAE – Joinville - SC (em execução),  Tenaris, Volvo – Curitiba PR (em execução), entre outros.\r\n \r\nPrincipais CARACTERÍSTICAS e VANTAGENS do Sistema Zebron:\r\n \r\n  Poliuretano Elastomérico 100% de sólidos, isento de solventes e metais pesados\r\n  Alta resistência a Corrosão, Impacto e Abrasão\r\n  Grande aderência ao aço e concreto\r\n  Altamente impermeável\r\n  Aprovado para o contato com água e alimentos\r\n  Permite reparação manual\r\n  Aplicado com equipamentos Airless Spray Plural Component de alta pressão que oferecem mobilidade e aplicação de película continua, homogênea e sem falhas na superfície\r\n  Revestimento monolítico que protege com uma película única e sem emendas\r\n  Zebron é flexível, acompanha os movimentos de dilatação e contração do substrato\r\n  De cura rápida, libera a estrutura para uso ou manuseio logo após a aplicação\r\n  Não agride o meio ambiente\r\n \r\nConfira os vídeos de nossas aplicações através dos links abaixo:\r\n•         Zebron do Brasil – Institucional = https://youtu.be/WAZXZsialxs\r\n•         Impermeabilização de Reservatório de Água Potável com Sistema Zebron 486 = https://youtu.be/XMxD6IKFuUU\r\n•         Revestimento de Silo de Aço Carbono com Sistema Zebron 486 = https://youtu.be/MIFXgIAjNxE\r\n•         Impermeabilização de Laje de Concreto com Sistema Zebron 486 = https://youtu.be/eker2qYItv4\r\n•         Demonstração de Aplicação do Sistema Zebron em Alta Espessura e Sua Excelente Resistência Mecânica = https://youtu.be/m9XLOYlGyf0\r\n•         Exemplo da Excelente Resistência ao Impacto dos Revestimentos Zebron = https://youtu.be/0JWYt8laTdY\r\n●    Impermeabilização de um reservatório de água potável - https://youtu.be/XMxD6IKFuUU \r\n \r\nAgradecemos a atenção e nos colocamos a disposição para maiores esclarecimentos, informações, solicitações de visitas técnicas e/ou orçamentos.\r\n \r\nEm sua próxima solicitação / necessidade de revestimentos, fale conosco!!!  \r\n\r\nAtentamente,\r\n \r\nCarlos Anibal Papasian Palma\r\nConsultor técnico / Representante comercial.\r\nDa Palma Consultoria, Representação e Soluções em Pintura Industrial SC -\r\nFone WatsApp - 034 - 9 9177.4526 - email carlosanibalppalma@hotmail.com  \r\nEmail carlos.palma@zebron.com.br \r\n \r\nAvelino Petrykowski \r\nDiretor\r\nEngetintas Revestimentos Anticorrosivos – Pinhais PR.\r\nAplicador e Representante nacional Zebron®\r\n+55 (41) 3668-4034 | +55 (41) 99974-6141\r\n','','','Av Getulio Vargas 1083','Jardim',3960,21,'179.159.185.251','S','34991774526','','2019-11-28 13:25:07',NULL,NULL),
