	(6027,'Luis Fernando Bastos','','luisfernandobastos.mkt@gmail.com','https://www.luisfernandobastos.com.br/','A Cirurgia Vascular é a especialidade médica voltada para o tratamento cirúrgico de doenças das artérias, veias e vasos linfáticos. Atua junto à Angiologia, especialidade responsável pelo estudo clínico dessas doenças.\r\n\r\nOs procedimentos médicos podem ser venosos ou arteriais.\r\n\r\nTECNOLOGIA DE REALIDADE AUMENTADA - Trabalhamos com um equipamento inovador, o VeinViewer. Através dele uma luz infravermelha, juntamente com tecnologias avançadas, é utilizada para exibir uma imagem vascular periférica diretamente na superfície da pele.\r\n\r\nEsta tecnologia é a primeira a projetar a veia com a exata localização anatômica (e com tamanho próximo de 97% de acurácia) e dá ao médico um “mapa’’ do sistema vascular, tornando o acesso e a análise muito mais eficiente. A imagem projetada é colocada em seu contexto tridimensional, o que torna muito mais fácil em identificar as características dos vasos, suas bifurcações e válvulas.','','','710/910 Sul, Ed. Via Brasil, Sala 222 Asa Sul, Brasília/DF','Asa Sul',3034,16,'177.205.66.244','N','(61) 3242-2002','','2019-12-20 16:07:20',NULL,NULL),
	(6028,'Mareli Esquadrias','20.454.607/0001-59','mkt.mareliesquadrias@gmail.com','https://mareliesquadrias.com.br/','PORTA DE MADEIRA\r\nAs portas de madeira são esquadrias importantes para a decoração da casa. Elas podem variar em tamanhos, texturas, cores e tipos de abertura – para atender todos os cômodos.\r\n\r\nNormalmente, as esquadrias de madeira são entregues na obra já montadas, com travamentos de proteção entre as folhas e fechos, devendo ser chumbadas às alvenarias por meio de pregos ou grapas, ou ainda fixados em contramarcos previamente colocados na parede\r\n\r\nESCADA DE MADEIRA\r\nAs escadas de madeira podem ser produzidas a partir de diferentes tipos de madeira.\r\n\r\nOs mais indicados são: peroba, ipê, jatobá, cumaru e pau-marfim. É imprescindível que a madeira seja tratada contra todo tipo de insetos (cupins, principalmente) e que tenha alta resistência.\r\n\r\nOs degraus devem ser seguros: altura e largura adequadas (o pé deve caber inteiro), assim como a profundidade, garantem baixíssimo risco de acidentes. Uma escada de madeira maciça bem cuidada dura muito tempo e é um detalhe inesquecível numa casa.\r\n\r\nPORTAS DE ALUMÍNIO\r\nA porta de alumínio é muito útil para ambientes da sua casa mais voltados para a área externa. Como o alumínio é um material resistente à água e ao sal, é ideal para áreas externas, resistindo melhor as ações do tempo. Além disso, o material ainda tem resistência contra ferrugens e é bem leve, o que facilita na hora de instalar.','','','MA Conjunto C Lote 9/10 Gama, DF – Brasil.','Gama-DF',3034,21,'177.205.66.244','N','(61)3045-7126','','2019-12-20 16:15:54',NULL,NULL),
