	(6034,'Dr. Luís Fernando Bastos','','luisfernandobastos.mkt@gmail.com','https://www.luisfernandobastos.com.br/','A Cirurgia Vascular é a especialidade médica voltada para o tratamento cirúrgico de doenças das artérias, veias e vasos linfáticos. Atua junto à Angiologia, especialidade responsável pelo estudo clínico dessas doenças.\r\n\r\nOs procedimentos médicos podem ser venosos ou arteriais.\r\n\r\nTECNOLOGIA DE REALIDADE AUMENTADA\r\nTrabalhamos com um equipamento inovador, o VeinViewer. Através dele uma luz infravermelha, juntamente com tecnologias avançadas, é utilizada para exibir uma imagem vascular periférica diretamente na superfície da pele.\r\n\r\nEsta tecnologia é a primeira a projetar a veia com a exata localização anatômica (e com tamanho próximo de 97% de acurácia) e dá ao médico um “mapa’’ do sistema vascular, tornando o acesso e a análise muito mais eficiente. A imagem projetada é colocada em seu contexto tridimensional, o que torna muito mais fácil em identificar as características dos vasos, suas bifurcações e válvulas.','','','710/910 Sul, Ed. Via Brasil, Sala 222 Asa Sul, Brasília/DF. CEP: 70390-108','Asa Sul',3034,16,'177.96.223.20','N','(61) 3242-2002','','2019-12-26 20:32:44',NULL,NULL),
