	(6037,' Mareli Esquadrias - Esquadrias de Alumínio e Madeira com toda a confiabilidade.','20.454.607/0001-59','mkt.mareliesquadrias@gmail.com','mkt.mareliesquadrias@gmail.com','PORTA DE MADEIRA\r\nAs portas de madeira são esquadrias importantes para a decoração da casa. Elas podem variar em tamanhos, texturas, cores e tipos de abertura – para atender todos os cômodos. Normalmente, as esquadrias de madeira são entregues na obra já montadas, com travamentos de proteção entre as folhas e fechos, devendo ser chumbadas às alvenarias por meio de pregos ou grapas, ou ainda fixados em contramarcos previamente colocados na parede.\r\n\r\nESCADA DE MADEIRA\r\nAs escadas de madeira podem ser produzidas a partir de diferentes tipos de madeira. Os mais indicados são: peroba, ipê, jatobá, cumaru e pau-marfim. É imprescindível que a madeira seja tratada contra todo tipo de insetos (cupins, principalmente) e que tenha alta resistência. Os degraus devem ser seguros: altura e largura adequadas (o pé deve caber inteiro), assim como a profundidade, garantem baixíssimo risco de acidentes. Uma escada de madeira maciça bem cuidada dura muito tempo e é um detalhe inesquecível numa casa.\r\n\r\nPORTAS DE ALUMÍNIO\r\nA porta de alumínio é muito útil para ambientes da sua casa mais voltados para a área externa. Como o alumínio é um material resistente à água e ao sal, é ideal para áreas externas, resistindo melhor as ações do tempo. Além disso, o material ainda tem resistência contra ferrugens e é bem leve, o que facilita na hora de instalar.','','','SMA Conjunto C, Lote 9/10, Gama - DF. CEP: 70297-400.','Gama-DF',3034,21,'177.96.223.20','N','(61) 3054-2304','','2019-12-26 20:51:41',NULL,NULL),
	(6038,'Força Fisioterapia','07.111.596/0001-46','marcos.mkt.levino@gmail.com','https://www.forcafisioterapia.com.br/','Especialidades: ortopédica-traumatológica, geriátrica e desportiva.\r\n\r\nA Fisioterapia visa tratar disfunções osteoarticulares e tendíneas resultantes de traumas, fraturas, LESÕES DE ESFORÇOS REPETITIVOS LER-DORT e suas consequências imediatas e tardias.\r\n\r\nO tratamento consiste na utilização de técnicas como eletroterapia, terapia manual, fortalecimento e alongamento muscular e treino sensório motor. Estas técnicas propiciam a melhora da capacidade de movimentação, estimulam a circulação e diminuem as dores dos pacientes.\r\n\r\nPRINCIPAIS TRATAMENTOS\r\nColuna: artrose, hérnia de disco, protusão de disco\r\nQuadril: Artrose, artroplastia, impacto\r\nJoelho: ligamentos, menisco, artrose\r\nOmbro: síndrome do impacto, luxação, fratura\r\nPré e pós-operatório','','','SGAS 910 Bloco E Salas 243, 245 e 247 Ed. Mix Park Sul','Asa Sul',3034,28,'191.249.109.12','N','(61) 3245-2277','','2019-12-27 18:21:20',NULL,NULL),
