	(6090,'Vânia Ladeira Joias','09.516.185/0001-66','contato@vanialadeira.com.br','https://vanialadeira.com.br','A marca Vânia Ladeira surge como proposta bem definida no ramo da joalheria, apoiada na formação acadêmica de sua criadora em Artes Plásticas e nos cursos que fez nas áreas de design e da confecção de joias. A criação das peças e sua materialização em metais e pedras preciosas é um experimento de feitura única e exclusiva. Em cada peça a designer estabelece sofisticada associação entre o conhecimento e a sua interpretação da arte e técnica da joalheria. As joias expressam estreita e indispensável ressonância com a personalidade e desejos do cliente, seus valores e sentimentos. A criação de cada joia materializa uma ponte entre o clássico e o contemporâneo, história que ultrapassa o tempo e não se perde em modismos.','https://www.facebook.com/VaniaLadeiraDesign','https://twitter.com/ladeiravania','CLN 213 Bloco A Loja 19. Brasília - DF',' Asa Norte',3034,24,'186.213.240.95','N','(61) 3349-0188','','2020-02-27 10:43:21',NULL,NULL),
