	(6106,'Dedetizadora Porto Alegre é Antinset','','contato@antinset.com.br','www.antinset.com.br','ANTINSET DEDETIZADORA DESENTUPIDORA oferece serviços de desentupimento em geral e limpeza pesada, possui equipe qualificada, tecnologia e equipamentos de ponta, que garantem o mais alto padrão de qualidade. Também oferece serviços de dedetização em geral, que podem chegar a 10 anos de garantia.\r\nPlantão 24 horas\r\nAtendemos urgências emergências\r\nCobrimos Qualquer oferta (após analises técnicas)\r\n \r\nExemplos de serviços que prestamos.\r\n» Desentupimento de Esgoto, Vaso Sanitário, Pia, Tanque, Coluna, Lavatório, Ralo ...\r\n» Limpeza de fossa séptica, fossa negra, caixa de decantação com caminhão limpa fossa ...\r\n» Esgotamento de reservatório, caixa d\'água, piscinas, lagoas de decantação, inundações ...\r\n» Limpeza de caixa de água e reservatório em residência, comércio ou indústria ...\r\n» Limpeza de caixa de gordura em casa, prédios, condomínio, restaurante, hotel ...\r\n» Bombeiro hidráulico: reparo, manutenção, instalação, tubulação entupida, vazando ...\r\n\r\nEliminamos pragas urbanas e rurais de todos os tipos, como, por exemplo, pombos, aranhas, cupins, ratos, baratas, formigas, entre tantas outras.\r\nAntinset Dedetizadora Desentupidora\r\nPorto Alegre, RS\r\n \r\nLeia Mais https://www.antinset.com.br\r\n51-33663803 \r\n51-996716602\r\ncontato.antinset@gmail.com\r\n \r\n\r\nEquipamentos de Controle de Pragas para Dedetizadoras\r\n \r\nOriginados a partir dos utilizados na agricultura, são usados na aplicação de inseticidas em saúde pública ou em empresas públicas e privada\r\nOs equipamentos são fundamentais, pois auxiliam na aplicação dos produtos químicos que efetivamente vão controlar as pragas.\r\nMas os equipamentos sozinhos não são suficientes.Temos algumas características determinantes na eficiência de medidas de controle de pragas;\r\n     - Adequações físicas da área com infestação.\r\n     - Equipamentos dimensionados adequadamente para o serviço\r\n     - Tecnologia de tratamento ou aplicação empregada\r\n     - Produtos específicos para controlar a praga alvo  \r\n\r\n \r\n\r\n        1. Pulverizadores\r\n\r\n        1.1. Pulverizadores costais manuais\r\n \r\n\r\n        Pela praticidade de uso e transporte, são os mais utilizados, com capacidade de volume de 4 a 20 litros são fabricados a partir de plásticos. Pressurizado por bombeamento a saída do líquido ocorre através de um gatilho localizado\r\n\r\nem uma lança com um bico na extremidade. A maioria dos pulverizadores possui uma aleta ligada à alavanca de acionamento da bomba, para promover a constante agitação de conteúdo do tanque. Pode atingir altas pressões, de até 5-6 kg/ cm, porém, a uniformidade da aplicação estará na dependência do operador na constância do bombeamento.\r\n\r\n\r\n        1.2. Pulverizadores costais pressurizados\r\n\r\n \r\n\r\n\r\n        Com um tanque de aço inoxidável e menor capacidade volumétrica estes pulverizadores recebem ar comprimido previamente à aplicação, ficando de 1/3 a 1/4 do tanque disponível para compressão do ar. durante a aplicação. com a diminuição da pressão há redução da vazão e aumento do tamanho das gotas. Assim, é aconselhável repressurizar o equipamento antes do esvaziamento do conteúdo. Este equipamento evita as variações de cobertura de aplicação existentes nas máquinas de acionamento manual.\r\n\r\n\r\n        1.3. Pulverizadores elétricos ou à gasolina\r\n\r\n\r\n\r\n\r\n        A diferença entre estes pulverizadores e os manuais está na maior autonomia, pressurização automática e constante. Por terem uma maior capacidade de armazenamento de produto, pode ser utilizado em serviços que necessitam de grande volume de calda inseticida. Outra vantagem deste equipamento é poder ser acoplado a várias mangueiras, para a saída do produto.\r\n\r\n\r\n        2. Polvilhadoras\r\n\r\n \r\n      \r\n        A polvilhadora através da corrente de ar que produz lança o produto. Para as aplicações efetuadas em centros urbanos, são encontradas com capacidade para 500 g a 1 kg de pó seco. Na agricultura são amplamente utilizadas para aplicação de defensivos em forma de pó seco. Em áreas urbanas são muito utilizadas para tratamento de formigueiros, cupins na rede elétrica, baratas em motores elétricos e insetos rasteiros em rede de esgoto e caixas elétricas.\r\n\r\n \r\n\r\n        3. Termonebulizadores\r\n\r\n   \r\n        Utiliza energia térmica para obter o fracionamento de finíssimas gotas que formam névoa espessa. O ingrediente ativo e o óleo diluente são injetados e vaporizados em gás aquecido que, quando em contato com o ambiente, sofrem condensação. Sua atuação no controle de insetos voadores deve-se ao contato da névoa e ao poder fumigante desta aplicação. Também é utilizado no controle de insetos rasteiros em rede de esgoto e áreas fechadas. É importante tomar cuidado com aplicações em rede de esgoto onde forma-se gás metano. Este gás é altamente inflamável e aponta de alguns termonebulizadores soltam até 10 centímetros com chama de fogo. Para aplicações em rede de esgoto, recomenda-se utilizar termonebulizador com motor à combustão 2 tempos a cilindro. Está máquina é conhecida também como fog a frio, pois não solta chama de fogo. Para contratar um serviço de termonebulização consulte a ANTINSET DEDETIZADORA especialista em controle de pragas.\r\n\r\n\r\n        4. Atomizadores ou Nebulizadores\r\n\r\n\r\n        Podem ser costais ou serem acoplados a um trator ou caminhonetes. Possuem motor a gasolina ou elétrico. Esses motores são responsáveis pela geração de pressão, que levam o inseticida até ao local desejado. A atomização é um método de aplicação destinado a áreas maiores que aquelas tratadas com pulverização. Pode ser utilizada em ambientes internos e externos. Consulte a ANTINSET DEDETIZADORA especialista em controle de pragas para realizar um serviço com atomizadores.\r\n\r\n\r\n        5. UBV - Ultra Baixo Volume\r\n\r\n        Estes equipamentos são semelhantes aos atomizadores, diferem na pressão e nos bicos de aplicação. São utilizados exclusivamente para tratamentos no combate a insetos voadores. Geralmente, são empregados em campanhas públicas contra mosquitos transmissores de doenças. Com esse equipamento, o produto é fracionado de forma a parecer uma neblina.\r\n\r\n \r\n\r\n        6. Pistolas aplicadoras de gel inseticida\r\n\r\n\r\n\r\n        Estes equipamentos funcionam como suporte para aplicar e dosar inseticida na forma de gel. Os modelos disponíveis no mercado podem ser classificados de três formas\r\n        -exercem controle total das gotas aplicadas\r\n        -exercem controle parcial das gotas aplicadas\r\n        -não exercem controle das gotas aplicadas.\r\n        São ideais na aplicação de produto para controle de Blatella germanica em áreas alimentícias. Consulte a ANTINSET DEDETIZADORA especialista em controle de pragas para realização de uma desinsetização com gel.\r\n\r\n\r\n        7. Armadilhas e Iscas\r\n\r\n\r\n        7.1. Armadilhas luminosas\r\n\r\n\r\n\r\nI        dealizadas para o controle de insetos voadores devem seguir um padrão de instalação:\r\n        - Disposição suficiente para realmente cobrir a área;\r\n        - Troca de Lâmpada a cada ano e limpeza semanal da bandeja;\r\n        - Disposição das armadilhas a uma altura média ideal de forma a não permitir que sejam vistas do lado de fora pelos insetos;\r\n        - Instalação das armadilhas a cerca de 4m da porta de entrada.\r\n\r\n\r\n        7.2. Adesivas ou pegajosas\r\n\r\n\r\n        São armadilhas com cola adesiva, como uma espécie de visgo, onde os insetos rasteiros são atraídos por pastilhas com atratividade e, ou, feromônio, onde são capturados e depois morrem. Tais armadilhas são úteis também para se fazer o monitoramente do local identificando pragas que normalmente não são vistas. Consulte a ANTINSET DEDETIZADORA especialista em controle de pragas para realizar estes procedimentos.\r\n\r\n \r\n\r\n        8. Seringas\r\n\r\n\r\n        As seringas normais ou de uso veterinário, são utilizadas para aplicar produto cupinicída nas madeiras através de orifícios e fendas. É um tratamento recomendado para combater cupins de madeira seca e brocas. Consulte a ANTINSET DEDETIZADORA especialista em controle de pragas para realizar este procedimento.\r\n\r\n \r\n        9. Trados injetores e equipamentos utilizados no controle de cupins\r\n\r\n\r\n\r\n        A descupinização exige atenção e experiência do controlador de pragas. A identificação da praga e o tipo de local são fatores determinantes na escolha dos equipamentos. O trado injetor é um equipamento muito útil para realizar barreiras químicas contra o cupim subterrâneo. Além do trado, podem ser requisitados furadeiras e marteletes industriais, brocas de 40 cm, marreta, picareta, ponteiro, talhadeira, serra, serrote, enfim, só a experiência e o convívio com a execução dos serviços poderão dar uma visão ampla ao controlador de pragas sobre quais e quantos equipamentos deve-se levar para realizar o serviço. Um outro equipamento muito importante é a microcâmera, facilitando a visualização em áreas de difícil acesso.\r\n\r\n\r\n        10. Porta iscas raticida\r\n\r\n        Quando as iscas raticidas necessitam de proteção e a área de aplicação oferecer risco para os animais e crianças, é recomendado a colocação de cochos que são os porta iscas. Consulte a ANTINSET DEDETIZADORA especialista em controle de pragas para utilizar este procedimento.\r\n\r\n \r\n\r\n        11. Equipamentos de uso domiciliar\r\n\r\n        Usa-se nas residências pequenos aparelhos ou pulverizadores para o controle de pragas que incluem  pequenos aparelhos pulverizadores, bombas de aerossol, espirais para mosquitos, fumigadores, uso de cortinas e redes de proteção, iscas atrativas com inseticida, cortinas de dormir impregnadas com piretróides contra os mosquitos, armadilhas luminosas e vários outros. Estes equipamentos utilizados isoladamente são somente atenuantes para um controle de pragas. Acertadamente um controle mais amplo deve ser realizado por uma empresa especializada, para tanto, consulte a ANTINSET DEDETIZADORA especialista em controle de pragas.\r\n\r\n \r\n\r\n        11.1. Aparelhos elétricos\r\n\r\n        Estes aparelhos devem ser ligados à tomada de energia elétrica, que ira aquecer a solução de inseticida ou papel impregnado de inseticida, que ira liberar o inseticida no ambiente.\r\n\r\nOs inseticidas normalmente utilizados são as piretrinas e piretróides de baixíssima toxidade. São produtos seguros, mas deve-se evitar utilizá-los na presença de pessoas alérgicas.\r\n\r\n \r\n\r\n        11.2. Bombas de aerossol ou latas pressurizadas\r\n\r\n        Suas formulações possuem um ou mais inseticidas combinados em um solvente com quantidades mínimas de inseticidas. São utilizados principalmente no combate de mosquitos, baratas, moscas. De uso doméstico, mas são usados também por empresas especializadas. Podemos ter junto com os inseticidas sinergistas que aumentam a eficiência do inseticida.\r\n\r\nOs gases propelentes podem ser butano e o propano que permitem que o inseticida saia em forma de pequenas partículas. Dentre os solventes, podem-se ter os produtos a base de solvente orgânicos, chamados de produtos com cheiro, e aqueles com base aquosa, chamados de produtos sem cheiro - o odor depende basicamente dos solventes e do inseticida utilizado.\r\n\r\n \r\n\r\n        11.3. Pulverizador de gatilho\r\n\r\n        Neste equipamento os diluentes e os inseticidas são forçados a atravessar um bico com o acionamento manual do pulverizador. A capacidade desse pulverizador varia de 0,5 a 1 litro.\r\n\r\n \r\n\r\n        11.4. Repelentes de insetos\r\n\r\n        São produtos químicos que previnem e ou evitam que artrópodes ataquem pessoas e animais. São utilizados em situações em que a proteção dos indivíduos e fundamental ou outros produtos químicos não são viáveis.\r\n\r\nOs repelentes são utilizados diretamente na pele ou nas roupas. Eles são simplesmente atenuantes no controle de pragas, se apresentam na forma de líquidos, loções, cremes, aerossóis, e outras formas. A permetrina tem sido usada como repelentes de roupas a deltamentrina e a lambdacialotrina  como repelente e controle em mosquiteiros, cortina e ráfia.\r\n\r\nA bolinha de naftalina em ambientes fechados pode repelir os insetos, sendo usada em guarda-roupas, gaveteiros etc.\r\n\r\n \r\n\r\n        11.5. Espirais\r\n\r\n        São utilizadas para repelir mosquitos ou pernilongos. Acessa durante a noite durante varias horas sua fumaça derruba os mosquitos que estão voando. Sua composição é a base de um pó de serra mais um nitrato para ajudar na combustão e uma piretrina ou piretróide.\r\n\r\n \r\n\r\n        11.6. Armadilhas\r\n\r\n\r\n        11.6.1. Armadilhas com feromônios\r\n\r\n        Os feromônios sintéticos imitam a ação dos feromônios naturais produzidos por insetos, sendo uma indispensável ferramenta utilizada no monitoramento de populações adultas de traças e carunchos dos grãos armazenados, da mosca doméstica e mosca das frutas.\r\n\r\nA localização das armadilhas e fundamental para o controle. Essas armadilhas devem observadas com freqüência diária, limpadas e substituindo o feromônio.\r\n\r\n\r\n        11.6.2. Armadilhas luminosas  \r\n\r\n        Essas armadilhas são equipamentos com lâmpadas de luz negra ou de luz ultravioleta, atraem diversos insetos voadores, são recomendadas para o controle em áreas internas dos edifícios. Algumas possuem uma grade elétrica ao redor da lâmpada, que mata os insetos quando em contato, ou uma placa de cola abaixo da lâmpada. As lâmpadas dessas armadilhas devem ser tocadas uma vez por ano, pois perdem eficiência.\r\n\r\n\r\n        11.6.3. Armadilhas de cola pega-barata\r\n\r\n        São úteis no monitoramento da população de baratas e camundongos. Com elas identificar a espécie praga e a localização das infestações mais altas. Devem ser colocadas nos prováveis locais de infestação onde as pragas caminham e se escondem.\r\n\r\n\r\n        11. 6.4. Armadilhas de cola pega-mosca\r\n\r\n        Podem ter forma de fio ou tira impregnadas de cola adesiva. Podem ser usadas para monitoramento da população de moscas em locais fechados, sendo que alguns fabricantes adicionam feromônio à armadilha para melhor eficiência. Deve-se evitar usá-las em locais com muito pó, por aderir à cola.\r\n\r\n \r\n\r\n        12. Quanto à seleção dos equipamentos para cada tipo de serviço\r\n\r\n        A seleção do equipamento apropriado é parte importante de uma programação para controle de pragas, portanto para cada situação deve-se buscar o equipamento mais apropriado para o serviço que se pretende realizar.\r\n\r\n \r\n\r\n        Vamos dividir as aplicações com seus equipamentos mais adequados em aplicações residuais e aplicações espaciais. Elas podem ser: INTRADOMICILIO – quando a aplicação e feita  dentro da casa  PERIDOMICILIO – quando a aplicação e feita ao redor da casa, ou anexos\r\n\r\n \r\n\r\n        12.1. Pulverização residual\r\n\r\n        O inseticida é aplicado sobre uma superfície, de forma a manter um resíduo, que permanecerá matando as pragas que entrarem em contato com a superfície.\r\n\r\n\r\n        12.1.1. Equipamentos utilizados:\r\n\r\n\r\n      12.1.1.1. pulverizadores costais manuais, pulverizadores pressurizados, pulverizadores elétricos.\r\n\r\n        Esta é a forma mais comum de aplicação de inseticidas por empresas profissionais. Sua importância esta no peso reduzido, que facilita a locomoção dos aplicadores\r\n\r\n        Formulação recomendadas na aplicação residual\r\n\r\n        Recomenda-se pó molhavel (WP ou PM), suspensão concentrada (FW ou SC) e microencapsulada (CS). Não e recomendado o uso da formulação concentrada emulsionável (CE) devido ao baixo efeito residual em superfícies porosas.\r\n\r\n\r\n       12.1.1.2. Polvilhadeira\r\n\r\n        Esse tipo de aplicação é ideal para locais em que se deseja um efeito residual prolongado e em superfícies que não podem ser umedecidos com uma pulverização. Em geral esse tipo de aplicação e recomendada frequentemente para pragas como baratas, pulgas, e formigas. Há polvilhadeiras manuais, elétricas e motorizadas.\r\n\r\n \r\n\r\n        12.2. Pulverização espacial\r\n\r\n        Aplicação espacial e a aplicação de um inseticida através de uma nevoa muito fina na qual a quantidade de produto aplicada é mito pequena. Esse tipo de aplicação não possui efeito residual, sua ação concentra-se nos insetos que estejam voando, ou deixa um resíduo muito pequeno nas superfícies. Estas aplicações realizam-se tanto intradomícilio quanto no peridomicílio. As formulações recomendadas são o concentrado emulsionável (CE) e as formulações ultra baixo volume (UBV) prontas para uso.\r\n\r\n \r\n\r\n        12.2.1. Equipamentos utilizados\r\n\r\n\r\n       12.2.1.1. Atomizadores UBV (ultra baixo volume)\r\n\r\n        Ultra baixo volume consiste em uma aplicação com baixo volume por área tratada com soluções concentradas. Apresenta um bom rendimento, aplicando-se em média 300 a 500 ml de produto diluído ou concentrado por há. Neste método, as partículas liquidas são muito pequenas (abaixo de 30 micras), sendo que o tamanho ideal é ao redor de 18 micras quando o corpo do mosquito é atingido por uma quantidade grande de partículas do inseticida. As gotas maiores de 30 micras não atingem o mosquito, caindo ao chão poucos metros a frente do equipamento.\r\n\r\nO inseticida pode ser diluído em óleo mineral, vegetal, ou água dependendo do equipamento e do produto. Há equipamentos montados em veículos ou portáteis.\r\n\r\n\r\n       12.2.1.2. Termonebulizadores (FOG ou FUMACÊ)\r\n\r\n        Os termonebulizadores usam o calor para vaporizar uma solução oleosa com inseticida. Apresentam partículas com um espectro de gotas de 0 a 50 micras. São usados em programas de controle espacial de vetores (dengue, malaria, febre amarela), desinsetização de ambientes como supermercados, armazéns, silos, rede de esgotos etc. A aplicação com termonebulizadores produz uma fumaça visível, ao contrario da aplicação ultra baixo volume (UBV) que apresenta uma névoa fina.\r\n\r\n\r\n        12.1.1.3. Atomizadores\r\n\r\n       12.1.1.3.1. Atomizadores rotativos\r\n\r\n        São popularmente chamados de turbinas, e constituído de um rotor, acionado por pequenas pás de hélice movidas por um escoamento forçado de ar\r\n\r\n\r\n       12.1.1.3.1. Bocal Atomizador Pneumático\r\n\r\n        Esses atomizadores produzem um jato de alcance longo próprio para pulverizações em ruas. As gotas formam-se pelo cisalhamento do líquido\r\n\r\nContra uma superfície em um escoamento de ar em alta velocidade. \r\n\r\n \r\n\r\n       12.2.2 Equipamentos portáteis e montados em veículos\r\n\r\n        Os equipamentos de aplicação espacial podem ser divididos em portáteis (com aplicação manual) e montados em veículos\r\n\r\n\r\n       12.2.2.1. Equipamentos montados em veículos\r\n\r\n        Estes equipamentos de termonebulização e UBV apresentam a vantagem de possuir um tratamento rápido, pulverizando uma grande área em pouco tempo\r\n\r\n\r\n       12.2.2.1. Equipamentos portáteis\r\n\r\n        Os de termonebulização portátil e UBV apresentam a vantagem de atingir locais de difícil acesso aos equipamentos montados em veículos. Como lixões, borracharias, favelas etc. Estas aplicações proporcionam um controle mais eficiente dos insetos voadores em locais de defícil acesso.\r\n\r\nAntinset Dedetizadora Desentupidora\r\nPorto Alegre, RS\r\n \r\nLeia Mais https://www.antinset.com.br\r\n51-33663803\r\ncontato.antinset@gmail.com\r\n \r\n\r\nControle de Pragas\r\n 	\r\n 	 \r\nAs pragas têm origem anterior à civilização do homem, mas seus danos só aconteceram depois do desequilíbrio ecológico que ele próprio causou. Com o desenvolvimento das civilizações, eventos antes inexistentes passaram a permitir a proliferação de alguns animais, como o acúmulo do lixo e alimentos sem cuidados necessários.\r\n\r\nA expansão urbana ocasionou na diminuição de alguns predadores naturais, permitindo que pudessem se proliferar com mais facilidade. Portanto, a existência desses animais na condição de praga propriamente dita é resultante das atividades do próprio homem, que permitiu que encontrassem abundância de abrigo e alimento, e consequentemente facilidade para se reproduzir.\r\n\r\nO descontrole causa muitos prejuízos ao homem, não só por danos a alimentos estocados ou produtos que podem ser danificados, mas também podem vir a causar problemas à saúde das pessoas, tanto em casos isolados, como em grande escala.\r\n\r\nPara isso existe um método de controle padronizado denominado Controle Integrado de Pragas, que se baseia na higiene e prevenção como ferramentas, incorporando ações preventivas e corretivas à sua aplicação. Como por exemplo, a diminuição do uso de praguicidas, o estudo dos ciclos de vida das pragas, e com essas informações, definir medidas apropriadas para o combate e quais os critérios econômicos para a aplicação. Assim, conhecendo metodicamente o que é preciso combater, o controle acabará sendo mais eficiente. A definição das pragas a serem tratadas também é fundamental para dar prosseguimento no planejamento do controle.\r\n\r\nAntes de se iniciar o planejamento, é importante saber em qual ambiente o controle deverá ser aplicado, podendo este ser urbano ou rural. Em cada um dos casos, as pragas podem ser diferentes e, portanto, terem comportamentos distintos. Assim, toda a linha de planejamento poderá seguir um critério específico.\r\n\r\nPodemos, em ambos os casos, destacar alguns animais:\r\n\r\n• roedores: camundongos, ratos e ratazanas;\r\n• baratas;\r\n• formigas;\r\n• escorpiões;\r\n• carrapatos;\r\n• pulgas;\r\n• morcegos;\r\n• pombos, etc..\r\n\r\nO Controle Integrado de Pragas é feito em etapas que facilitam a tomada de atitudes, baseadas nos estudos a serem feitos do ambiente.\r\n\r\nA primeira etapa é a inspeção, que é feita nas áreas internas e externas do local, de maneira detalhada e acompanhada de um técnico responsável.\r\n\r\nTodos os ambientes do local, inclusive redes de esgoto, caixas de gordura, devem ser inspecionados sendo relevante obter informações com funcionários (no caso de uma empresa), moradores vizinhos, caseiros, e pessoas próximas em geral. Por meio disso, deve-se compreender as rotas de material orgânico e alimentos do ambiente, locais onde os animais e insetos localizarão como ambientes favoráveis para abrigo e alimentação.\r\n\r\nEm seguida, deverá ser feita a identificação das espécies encontradas para se saber exatamente o procedimento a ser tomado e o dano que este pode vir a causar. A identificação precisa ser específica de cada animal. Caso encontre-se um rato, por exemplo, identificar qual espécie é: Rato-preto (Rattus rattus) ou Ratazana (Rattus norvegicus).\r\n\r\nA utilização do nome científico das espécies é importante justamente para se conhecer o procedimento adequado a ser tomado e os danos que os animais podem causar. Uma vez que a identificação é essencial, é importante que seja feita por um profissional com amplos conhecimentos na área de identificação de animais. Já foram encontrados em silos de armazenagem de grãos alguns besouros (coleópteros) e traças (lepidópteros), que alimentam-se da parte interna dos grãos, causando grande perda de peso nas sacas e redução dos nutrientes e do poder germinativo. Assim, é possível estipular a sua perda e calcular o prejuízo financeiro, que também é uma etapa importante da identificação.\r\n\r\nEsses animais podem acarretar o surgimento de outros males como fungos e bactérias, que também causarão prejuízos.\r\n\r\nO próximo passo será o diagnóstico, onde deverá ocorrer a definição das áreas críticas de controle, a partir dos resultados obtidos anteriormente.\r\n\r\nDefinindo essas áreas, será feito um planejamento estipulando as áreas mais importantes a serem trabalhadas, os locais específicos a serem aplicados rodenticidas (veneno para roedores, se houver indício de ratos) e a dose necessária. Portanto, deverá ser estipulada a quantidade de pessoas que serão responsáveis por cada fase do controle, em cada área definida.\r\n\r\nA próxima etapa é o controle químico do ambiente. Serão aplicadas substâncias para o controle biológico dos animais, como adulticidas (substâncias que combatem animais em fase adulta), rodenticidas, inseticidas e larvicidas, que combatem insetos e larvas respectivamente, dentre outros. Logo após o controle químico, deverá ser feito o controle mecânico. Esse controle é feito usando equipamentos que deverão conter ou matar as pragas.\r\n\r\nMuitos equipamentos são conhecidos, como ratoeiras, papeis adesivos e armadilhas de captura. Podem ser usados aparelhos ultrassônicos e telas, que servirão para afastar esses animais ou impedir o seu acesso.\r\n\r\nFinalizando as etapas acima, serão tomadas agora as medidas preventivas e corretivas. Elas diferenciam-se pelo foco de sua atuação.\r\n\r\nAs ações preventivas visam impedir que as pragas ocorram ou voltem a ocorrer. Já as ações corretivas são basicamente a instalação de barreiras físicas, a fim de impedir sua entrada ou sua acomodação posterior, justamente naqueles locais onde foram identificadas falhas nas etapas anteriores.\r\n\r\nApós serem concluídas as etapas de medidas preventivas e corretivas deve ser feito, por último, o monitoramento. Todas as etapas anteriormente descritas deverão ser periodicamente checadas e reforçadas para que as chances de invasão por insetos e roedores sejam sempre reduzidas. Isso implica no monitoramento contínuo das infestações, e principalmente, o reforço para que ocorra a mudança dos hábitos prejudiciais ao controle.\r\n\r\nVeja também:	• Controle de Pragas em Restaurantes\r\n• Controle de Pragas em Hospitais	• Controle de Pragas Insetos Rasteiros, Voadores\r\n• Produtos Utilizados no Controle de Pragas	• Diferença entre Controle de Pragas e Desinsetização\r\n• Quando Utilizar o Controle de Pragas	• Eficácia do Controle de Pragas\r\n• Medidas Preventivas/Corretivas no Controle de Pragas	• Monitoramento de Pragas\r\n• Controle de Pragas em Restaurantes Industriais	• No que Consiste o Manejo Integrado de Pragas\r\n \r\n\r\nPalavras chave\r\n\r\nDedetização em Porto Alegre\r\n\r\nDedetização Porto Alegre\r\n\r\nDedetização Canoas\r\n\r\nDedetização em Canoas\r\n\r\nDedetização em Cachoeirinha\r\n\r\nDedetização Cachoeirinha\r\n\r\nLimpeza de cx de agua Porto Alegre\r\n\r\nLimpeza de cx de agua em Porto Alegre\r\n\r\nDedetização de Escorpião Porto Alegre\r\n\r\nDedetização de Escorpião em Porto Alegre\r\n\r\nControle de Pragas em Porto Alegre\r\n\r\nControle de Pragas Porto Alegre\r\n\r\nDescupinização em Porto Alegre\r\n\r\nDescupinização Porto Alegre\r\n\r\nAntinset Dedetizadora Desentupidora\r\nPorto Alegre, RS\r\n \r\nLeia Mais https://www.antinset.com.br\r\n\r\n\r\nLeia mais: https://dedetizadora-antinset-poa.webnode.com/','https://www.facebook.com/Dedetizadoraportoalegre/?eid=ARBA1-LMNcxkWHcuA37s43pTGEhlZih1hDyHjR682tILXKk5DN51xP5Tn11EBRPCCi','','Av. Nilo peçanha, 1010','Bela Vista',9053,3,'189.6.234.25','N','5133663803,51996716602','','2020-03-24 12:55:06',NULL,NULL),
	(6107,'Desratização em Porto Alegre','','contato@antinset.com.br','www.antinset.com.br','ANTINSET DEDETIZADORA DESENTUPIDORA oferece serviços de desentupimento em geral e limpeza pesada, possui equipe qualificada, tecnologia e equipamentos de ponta, que garantem o mais alto padrão de qualidade. Também oferece serviços de dedetização em geral, que podem chegar a 10 anos de garantia.\r\nPlantão 24 horas\r\nAtendemos urgências emergências\r\nCobrimos Qualquer oferta (após analises técnicas)\r\n \r\nExemplos de serviços que prestamos.\r\n» Desentupimento de Esgoto, Vaso Sanitário, Pia, Tanque, Coluna, Lavatório, Ralo ...\r\n» Limpeza de fossa séptica, fossa negra, caixa de decantação com caminhão limpa fossa ...\r\n» Esgotamento de reservatório, caixa d\'água, piscinas, lagoas de decantação, inundações ...\r\n» Limpeza de caixa de água e reservatório em residência, comércio ou indústria ...\r\n» Limpeza de caixa de gordura em casa, prédios, condomínio, restaurante, hotel ...\r\n» Bombeiro hidráulico: reparo, manutenção, instalação, tubulação entupida, vazando ...\r\n\r\nEliminamos pragas urbanas e rurais de todos os tipos, como, por exemplo, pombos, aranhas, cupins, ratos, baratas, formigas, entre tantas outras.\r\nAntinset Dedetizadora Desentupidora\r\nPorto Alegre, RS\r\n \r\nLeia Mais https://www.antinset.com.br\r\n51-33663803 \r\n51-996716602\r\ncontato.antinset@gmail.com\r\n \r\n\r\nEquipamentos de Controle de Pragas para Dedetizadoras\r\n \r\nOriginados a partir dos utilizados na agricultura, são usados na aplicação de inseticidas em saúde pública ou em empresas públicas e privada\r\nOs equipamentos são fundamentais, pois auxiliam na aplicação dos produtos químicos que efetivamente vão controlar as pragas.\r\nMas os equipamentos sozinhos não são suficientes.Temos algumas características determinantes na eficiência de medidas de controle de pragas;\r\n     - Adequações físicas da área com infestação.\r\n     - Equipamentos dimensionados adequadamente para o serviço\r\n     - Tecnologia de tratamento ou aplicação empregada\r\n     - Produtos específicos para controlar a praga alvo  \r\n\r\n \r\n\r\n        1. Pulverizadores\r\n\r\n        1.1. Pulverizadores costais manuais\r\n \r\n\r\n        Pela praticidade de uso e transporte, são os mais utilizados, com capacidade de volume de 4 a 20 litros são fabricados a partir de plásticos. Pressurizado por bombeamento a saída do líquido ocorre através de um gatilho localizado\r\n\r\nem uma lança com um bico na extremidade. A maioria dos pulverizadores possui uma aleta ligada à alavanca de acionamento da bomba, para promover a constante agitação de conteúdo do tanque. Pode atingir altas pressões, de até 5-6 kg/ cm, porém, a uniformidade da aplicação estará na dependência do operador na constância do bombeamento.\r\n\r\n\r\n        1.2. Pulverizadores costais pressurizados\r\n\r\n \r\n\r\n\r\n        Com um tanque de aço inoxidável e menor capacidade volumétrica estes pulverizadores recebem ar comprimido previamente à aplicação, ficando de 1/3 a 1/4 do tanque disponível para compressão do ar. durante a aplicação. com a diminuição da pressão há redução da vazão e aumento do tamanho das gotas. Assim, é aconselhável repressurizar o equipamento antes do esvaziamento do conteúdo. Este equipamento evita as variações de cobertura de aplicação existentes nas máquinas de acionamento manual.\r\n\r\n\r\n        1.3. Pulverizadores elétricos ou à gasolina\r\n\r\n\r\n\r\n\r\n        A diferença entre estes pulverizadores e os manuais está na maior autonomia, pressurização automática e constante. Por terem uma maior capacidade de armazenamento de produto, pode ser utilizado em serviços que necessitam de grande volume de calda inseticida. Outra vantagem deste equipamento é poder ser acoplado a várias mangueiras, para a saída do produto.\r\n\r\n\r\n        2. Polvilhadoras\r\n\r\n \r\n      \r\n        A polvilhadora através da corrente de ar que produz lança o produto. Para as aplicações efetuadas em centros urbanos, são encontradas com capacidade para 500 g a 1 kg de pó seco. Na agricultura são amplamente utilizadas para aplicação de defensivos em forma de pó seco. Em áreas urbanas são muito utilizadas para tratamento de formigueiros, cupins na rede elétrica, baratas em motores elétricos e insetos rasteiros em rede de esgoto e caixas elétricas.\r\n\r\n \r\n\r\n        3. Termonebulizadores\r\n\r\n   \r\n        Utiliza energia térmica para obter o fracionamento de finíssimas gotas que formam névoa espessa. O ingrediente ativo e o óleo diluente são injetados e vaporizados em gás aquecido que, quando em contato com o ambiente, sofrem condensação. Sua atuação no controle de insetos voadores deve-se ao contato da névoa e ao poder fumigante desta aplicação. Também é utilizado no controle de insetos rasteiros em rede de esgoto e áreas fechadas. É importante tomar cuidado com aplicações em rede de esgoto onde forma-se gás metano. Este gás é altamente inflamável e aponta de alguns termonebulizadores soltam até 10 centímetros com chama de fogo. Para aplicações em rede de esgoto, recomenda-se utilizar termonebulizador com motor à combustão 2 tempos a cilindro. Está máquina é conhecida também como fog a frio, pois não solta chama de fogo. Para contratar um serviço de termonebulização consulte a ANTINSET DEDETIZADORA especialista em controle de pragas.\r\n\r\n\r\n        4. Atomizadores ou Nebulizadores\r\n\r\n\r\n        Podem ser costais ou serem acoplados a um trator ou caminhonetes. Possuem motor a gasolina ou elétrico. Esses motores são responsáveis pela geração de pressão, que levam o inseticida até ao local desejado. A atomização é um método de aplicação destinado a áreas maiores que aquelas tratadas com pulverização. Pode ser utilizada em ambientes internos e externos. Consulte a ANTINSET DEDETIZADORA especialista em controle de pragas para realizar um serviço com atomizadores.\r\n\r\n\r\n        5. UBV - Ultra Baixo Volume\r\n\r\n        Estes equipamentos são semelhantes aos atomizadores, diferem na pressão e nos bicos de aplicação. São utilizados exclusivamente para tratamentos no combate a insetos voadores. Geralmente, são empregados em campanhas públicas contra mosquitos transmissores de doenças. Com esse equipamento, o produto é fracionado de forma a parecer uma neblina.\r\n\r\n \r\n\r\n        6. Pistolas aplicadoras de gel inseticida\r\n\r\n\r\n\r\n        Estes equipamentos funcionam como suporte para aplicar e dosar inseticida na forma de gel. Os modelos disponíveis no mercado podem ser classificados de três formas\r\n        -exercem controle total das gotas aplicadas\r\n        -exercem controle parcial das gotas aplicadas\r\n        -não exercem controle das gotas aplicadas.\r\n        São ideais na aplicação de produto para controle de Blatella germanica em áreas alimentícias. Consulte a ANTINSET DEDETIZADORA especialista em controle de pragas para realização de uma desinsetização com gel.\r\n\r\n\r\n        7. Armadilhas e Iscas\r\n\r\n\r\n        7.1. Armadilhas luminosas\r\n\r\n\r\n\r\nI        dealizadas para o controle de insetos voadores devem seguir um padrão de instalação:\r\n        - Disposição suficiente para realmente cobrir a área;\r\n        - Troca de Lâmpada a cada ano e limpeza semanal da bandeja;\r\n        - Disposição das armadilhas a uma altura média ideal de forma a não permitir que sejam vistas do lado de fora pelos insetos;\r\n        - Instalação das armadilhas a cerca de 4m da porta de entrada.\r\n\r\n\r\n        7.2. Adesivas ou pegajosas\r\n\r\n\r\n        São armadilhas com cola adesiva, como uma espécie de visgo, onde os insetos rasteiros são atraídos por pastilhas com atratividade e, ou, feromônio, onde são capturados e depois morrem. Tais armadilhas são úteis também para se fazer o monitoramente do local identificando pragas que normalmente não são vistas. Consulte a ANTINSET DEDETIZADORA especialista em controle de pragas para realizar estes procedimentos.\r\n\r\n \r\n\r\n        8. Seringas\r\n\r\n\r\n        As seringas normais ou de uso veterinário, são utilizadas para aplicar produto cupinicída nas madeiras através de orifícios e fendas. É um tratamento recomendado para combater cupins de madeira seca e brocas. Consulte a ANTINSET DEDETIZADORA especialista em controle de pragas para realizar este procedimento.\r\n\r\n \r\n        9. Trados injetores e equipamentos utilizados no controle de cupins\r\n\r\n\r\n\r\n        A descupinização exige atenção e experiência do controlador de pragas. A identificação da praga e o tipo de local são fatores determinantes na escolha dos equipamentos. O trado injetor é um equipamento muito útil para realizar barreiras químicas contra o cupim subterrâneo. Além do trado, podem ser requisitados furadeiras e marteletes industriais, brocas de 40 cm, marreta, picareta, ponteiro, talhadeira, serra, serrote, enfim, só a experiência e o convívio com a execução dos serviços poderão dar uma visão ampla ao controlador de pragas sobre quais e quantos equipamentos deve-se levar para realizar o serviço. Um outro equipamento muito importante é a microcâmera, facilitando a visualização em áreas de difícil acesso.\r\n\r\n\r\n        10. Porta iscas raticida\r\n\r\n        Quando as iscas raticidas necessitam de proteção e a área de aplicação oferecer risco para os animais e crianças, é recomendado a colocação de cochos que são os porta iscas. Consulte a ANTINSET DEDETIZADORA especialista em controle de pragas para utilizar este procedimento.\r\n\r\n \r\n\r\n        11. Equipamentos de uso domiciliar\r\n\r\n        Usa-se nas residências pequenos aparelhos ou pulverizadores para o controle de pragas que incluem  pequenos aparelhos pulverizadores, bombas de aerossol, espirais para mosquitos, fumigadores, uso de cortinas e redes de proteção, iscas atrativas com inseticida, cortinas de dormir impregnadas com piretróides contra os mosquitos, armadilhas luminosas e vários outros. Estes equipamentos utilizados isoladamente são somente atenuantes para um controle de pragas. Acertadamente um controle mais amplo deve ser realizado por uma empresa especializada, para tanto, consulte a ANTINSET DEDETIZADORA especialista em controle de pragas.\r\n\r\n \r\n\r\n        11.1. Aparelhos elétricos\r\n\r\n        Estes aparelhos devem ser ligados à tomada de energia elétrica, que ira aquecer a solução de inseticida ou papel impregnado de inseticida, que ira liberar o inseticida no ambiente.\r\n\r\nOs inseticidas normalmente utilizados são as piretrinas e piretróides de baixíssima toxidade. São produtos seguros, mas deve-se evitar utilizá-los na presença de pessoas alérgicas.\r\n\r\n \r\n\r\n        11.2. Bombas de aerossol ou latas pressurizadas\r\n\r\n        Suas formulações possuem um ou mais inseticidas combinados em um solvente com quantidades mínimas de inseticidas. São utilizados principalmente no combate de mosquitos, baratas, moscas. De uso doméstico, mas são usados também por empresas especializadas. Podemos ter junto com os inseticidas sinergistas que aumentam a eficiência do inseticida.\r\n\r\nOs gases propelentes podem ser butano e o propano que permitem que o inseticida saia em forma de pequenas partículas. Dentre os solventes, podem-se ter os produtos a base de solvente orgânicos, chamados de produtos com cheiro, e aqueles com base aquosa, chamados de produtos sem cheiro - o odor depende basicamente dos solventes e do inseticida utilizado.\r\n\r\n \r\n\r\n        11.3. Pulverizador de gatilho\r\n\r\n        Neste equipamento os diluentes e os inseticidas são forçados a atravessar um bico com o acionamento manual do pulverizador. A capacidade desse pulverizador varia de 0,5 a 1 litro.\r\n\r\n \r\n\r\n        11.4. Repelentes de insetos\r\n\r\n        São produtos químicos que previnem e ou evitam que artrópodes ataquem pessoas e animais. São utilizados em situações em que a proteção dos indivíduos e fundamental ou outros produtos químicos não são viáveis.\r\n\r\nOs repelentes são utilizados diretamente na pele ou nas roupas. Eles são simplesmente atenuantes no controle de pragas, se apresentam na forma de líquidos, loções, cremes, aerossóis, e outras formas. A permetrina tem sido usada como repelentes de roupas a deltamentrina e a lambdacialotrina  como repelente e controle em mosquiteiros, cortina e ráfia.\r\n\r\nA bolinha de naftalina em ambientes fechados pode repelir os insetos, sendo usada em guarda-roupas, gaveteiros etc.\r\n\r\n \r\n\r\n        11.5. Espirais\r\n\r\n        São utilizadas para repelir mosquitos ou pernilongos. Acessa durante a noite durante varias horas sua fumaça derruba os mosquitos que estão voando. Sua composição é a base de um pó de serra mais um nitrato para ajudar na combustão e uma piretrina ou piretróide.\r\n\r\n \r\n\r\n        11.6. Armadilhas\r\n\r\n\r\n        11.6.1. Armadilhas com feromônios\r\n\r\n        Os feromônios sintéticos imitam a ação dos feromônios naturais produzidos por insetos, sendo uma indispensável ferramenta utilizada no monitoramento de populações adultas de traças e carunchos dos grãos armazenados, da mosca doméstica e mosca das frutas.\r\n\r\nA localização das armadilhas e fundamental para o controle. Essas armadilhas devem observadas com freqüência diária, limpadas e substituindo o feromônio.\r\n\r\n\r\n        11.6.2. Armadilhas luminosas  \r\n\r\n        Essas armadilhas são equipamentos com lâmpadas de luz negra ou de luz ultravioleta, atraem diversos insetos voadores, são recomendadas para o controle em áreas internas dos edifícios. Algumas possuem uma grade elétrica ao redor da lâmpada, que mata os insetos quando em contato, ou uma placa de cola abaixo da lâmpada. As lâmpadas dessas armadilhas devem ser tocadas uma vez por ano, pois perdem eficiência.\r\n\r\n\r\n        11.6.3. Armadilhas de cola pega-barata\r\n\r\n        São úteis no monitoramento da população de baratas e camundongos. Com elas identificar a espécie praga e a localização das infestações mais altas. Devem ser colocadas nos prováveis locais de infestação onde as pragas caminham e se escondem.\r\n\r\n\r\n        11. 6.4. Armadilhas de cola pega-mosca\r\n\r\n        Podem ter forma de fio ou tira impregnadas de cola adesiva. Podem ser usadas para monitoramento da população de moscas em locais fechados, sendo que alguns fabricantes adicionam feromônio à armadilha para melhor eficiência. Deve-se evitar usá-las em locais com muito pó, por aderir à cola.\r\n\r\n \r\n\r\n        12. Quanto à seleção dos equipamentos para cada tipo de serviço\r\n\r\n        A seleção do equipamento apropriado é parte importante de uma programação para controle de pragas, portanto para cada situação deve-se buscar o equipamento mais apropriado para o serviço que se pretende realizar.\r\n\r\n \r\n\r\n        Vamos dividir as aplicações com seus equipamentos mais adequados em aplicações residuais e aplicações espaciais. Elas podem ser: INTRADOMICILIO – quando a aplicação e feita  dentro da casa  PERIDOMICILIO – quando a aplicação e feita ao redor da casa, ou anexos\r\n\r\n \r\n\r\n        12.1. Pulverização residual\r\n\r\n        O inseticida é aplicado sobre uma superfície, de forma a manter um resíduo, que permanecerá matando as pragas que entrarem em contato com a superfície.\r\n\r\n\r\n        12.1.1. Equipamentos utilizados:\r\n\r\n\r\n      12.1.1.1. pulverizadores costais manuais, pulverizadores pressurizados, pulverizadores elétricos.\r\n\r\n        Esta é a forma mais comum de aplicação de inseticidas por empresas profissionais. Sua importância esta no peso reduzido, que facilita a locomoção dos aplicadores\r\n\r\n        Formulação recomendadas na aplicação residual\r\n\r\n        Recomenda-se pó molhavel (WP ou PM), suspensão concentrada (FW ou SC) e microencapsulada (CS). Não e recomendado o uso da formulação concentrada emulsionável (CE) devido ao baixo efeito residual em superfícies porosas.\r\n\r\n\r\n       12.1.1.2. Polvilhadeira\r\n\r\n        Esse tipo de aplicação é ideal para locais em que se deseja um efeito residual prolongado e em superfícies que não podem ser umedecidos com uma pulverização. Em geral esse tipo de aplicação e recomendada frequentemente para pragas como baratas, pulgas, e formigas. Há polvilhadeiras manuais, elétricas e motorizadas.\r\n\r\n \r\n\r\n        12.2. Pulverização espacial\r\n\r\n        Aplicação espacial e a aplicação de um inseticida através de uma nevoa muito fina na qual a quantidade de produto aplicada é mito pequena. Esse tipo de aplicação não possui efeito residual, sua ação concentra-se nos insetos que estejam voando, ou deixa um resíduo muito pequeno nas superfícies. Estas aplicações realizam-se tanto intradomícilio quanto no peridomicílio. As formulações recomendadas são o concentrado emulsionável (CE) e as formulações ultra baixo volume (UBV) prontas para uso.\r\n\r\n \r\n\r\n        12.2.1. Equipamentos utilizados\r\n\r\n\r\n       12.2.1.1. Atomizadores UBV (ultra baixo volume)\r\n\r\n        Ultra baixo volume consiste em uma aplicação com baixo volume por área tratada com soluções concentradas. Apresenta um bom rendimento, aplicando-se em média 300 a 500 ml de produto diluído ou concentrado por há. Neste método, as partículas liquidas são muito pequenas (abaixo de 30 micras), sendo que o tamanho ideal é ao redor de 18 micras quando o corpo do mosquito é atingido por uma quantidade grande de partículas do inseticida. As gotas maiores de 30 micras não atingem o mosquito, caindo ao chão poucos metros a frente do equipamento.\r\n\r\nO inseticida pode ser diluído em óleo mineral, vegetal, ou água dependendo do equipamento e do produto. Há equipamentos montados em veículos ou portáteis.\r\n\r\n\r\n       12.2.1.2. Termonebulizadores (FOG ou FUMACÊ)\r\n\r\n        Os termonebulizadores usam o calor para vaporizar uma solução oleosa com inseticida. Apresentam partículas com um espectro de gotas de 0 a 50 micras. São usados em programas de controle espacial de vetores (dengue, malaria, febre amarela), desinsetização de ambientes como supermercados, armazéns, silos, rede de esgotos etc. A aplicação com termonebulizadores produz uma fumaça visível, ao contrario da aplicação ultra baixo volume (UBV) que apresenta uma névoa fina.\r\n\r\n\r\n        12.1.1.3. Atomizadores\r\n\r\n       12.1.1.3.1. Atomizadores rotativos\r\n\r\n        São popularmente chamados de turbinas, e constituído de um rotor, acionado por pequenas pás de hélice movidas por um escoamento forçado de ar\r\n\r\n\r\n       12.1.1.3.1. Bocal Atomizador Pneumático\r\n\r\n        Esses atomizadores produzem um jato de alcance longo próprio para pulverizações em ruas. As gotas formam-se pelo cisalhamento do líquido\r\n\r\nContra uma superfície em um escoamento de ar em alta velocidade. \r\n\r\n \r\n\r\n       12.2.2 Equipamentos portáteis e montados em veículos\r\n\r\n        Os equipamentos de aplicação espacial podem ser divididos em portáteis (com aplicação manual) e montados em veículos\r\n\r\n\r\n       12.2.2.1. Equipamentos montados em veículos\r\n\r\n        Estes equipamentos de termonebulização e UBV apresentam a vantagem de possuir um tratamento rápido, pulverizando uma grande área em pouco tempo\r\n\r\n\r\n       12.2.2.1. Equipamentos portáteis\r\n\r\n        Os de termonebulização portátil e UBV apresentam a vantagem de atingir locais de difícil acesso aos equipamentos montados em veículos. Como lixões, borracharias, favelas etc. Estas aplicações proporcionam um controle mais eficiente dos insetos voadores em locais de defícil acesso.\r\n\r\nAntinset Dedetizadora Desentupidora\r\nPorto Alegre, RS\r\n \r\nLeia Mais https://www.antinset.com.br\r\n51-33663803\r\ncontato.antinset@gmail.com\r\n \r\n\r\nControle de Pragas\r\n 	\r\n 	 \r\nAs pragas têm origem anterior à civilização do homem, mas seus danos só aconteceram depois do desequilíbrio ecológico que ele próprio causou. Com o desenvolvimento das civilizações, eventos antes inexistentes passaram a permitir a proliferação de alguns animais, como o acúmulo do lixo e alimentos sem cuidados necessários.\r\n\r\nA expansão urbana ocasionou na diminuição de alguns predadores naturais, permitindo que pudessem se proliferar com mais facilidade. Portanto, a existência desses animais na condição de praga propriamente dita é resultante das atividades do próprio homem, que permitiu que encontrassem abundância de abrigo e alimento, e consequentemente facilidade para se reproduzir.\r\n\r\nO descontrole causa muitos prejuízos ao homem, não só por danos a alimentos estocados ou produtos que podem ser danificados, mas também podem vir a causar problemas à saúde das pessoas, tanto em casos isolados, como em grande escala.\r\n\r\nPara isso existe um método de controle padronizado denominado Controle Integrado de Pragas, que se baseia na higiene e prevenção como ferramentas, incorporando ações preventivas e corretivas à sua aplicação. Como por exemplo, a diminuição do uso de praguicidas, o estudo dos ciclos de vida das pragas, e com essas informações, definir medidas apropriadas para o combate e quais os critérios econômicos para a aplicação. Assim, conhecendo metodicamente o que é preciso combater, o controle acabará sendo mais eficiente. A definição das pragas a serem tratadas também é fundamental para dar prosseguimento no planejamento do controle.\r\n\r\nAntes de se iniciar o planejamento, é importante saber em qual ambiente o controle deverá ser aplicado, podendo este ser urbano ou rural. Em cada um dos casos, as pragas podem ser diferentes e, portanto, terem comportamentos distintos. Assim, toda a linha de planejamento poderá seguir um critério específico.\r\n\r\nPodemos, em ambos os casos, destacar alguns animais:\r\n\r\n• roedores: camundongos, ratos e ratazanas;\r\n• baratas;\r\n• formigas;\r\n• escorpiões;\r\n• carrapatos;\r\n• pulgas;\r\n• morcegos;\r\n• pombos, etc..\r\n\r\nO Controle Integrado de Pragas é feito em etapas que facilitam a tomada de atitudes, baseadas nos estudos a serem feitos do ambiente.\r\n\r\nA primeira etapa é a inspeção, que é feita nas áreas internas e externas do local, de maneira detalhada e acompanhada de um técnico responsável.\r\n\r\nTodos os ambientes do local, inclusive redes de esgoto, caixas de gordura, devem ser inspecionados sendo relevante obter informações com funcionários (no caso de uma empresa), moradores vizinhos, caseiros, e pessoas próximas em geral. Por meio disso, deve-se compreender as rotas de material orgânico e alimentos do ambiente, locais onde os animais e insetos localizarão como ambientes favoráveis para abrigo e alimentação.\r\n\r\nEm seguida, deverá ser feita a identificação das espécies encontradas para se saber exatamente o procedimento a ser tomado e o dano que este pode vir a causar. A identificação precisa ser específica de cada animal. Caso encontre-se um rato, por exemplo, identificar qual espécie é: Rato-preto (Rattus rattus) ou Ratazana (Rattus norvegicus).\r\n\r\nA utilização do nome científico das espécies é importante justamente para se conhecer o procedimento adequado a ser tomado e os danos que os animais podem causar. Uma vez que a identificação é essencial, é importante que seja feita por um profissional com amplos conhecimentos na área de identificação de animais. Já foram encontrados em silos de armazenagem de grãos alguns besouros (coleópteros) e traças (lepidópteros), que alimentam-se da parte interna dos grãos, causando grande perda de peso nas sacas e redução dos nutrientes e do poder germinativo. Assim, é possível estipular a sua perda e calcular o prejuízo financeiro, que também é uma etapa importante da identificação.\r\n\r\nEsses animais podem acarretar o surgimento de outros males como fungos e bactérias, que também causarão prejuízos.\r\n\r\nO próximo passo será o diagnóstico, onde deverá ocorrer a definição das áreas críticas de controle, a partir dos resultados obtidos anteriormente.\r\n\r\nDefinindo essas áreas, será feito um planejamento estipulando as áreas mais importantes a serem trabalhadas, os locais específicos a serem aplicados rodenticidas (veneno para roedores, se houver indício de ratos) e a dose necessária. Portanto, deverá ser estipulada a quantidade de pessoas que serão responsáveis por cada fase do controle, em cada área definida.\r\n\r\nA próxima etapa é o controle químico do ambiente. Serão aplicadas substâncias para o controle biológico dos animais, como adulticidas (substâncias que combatem animais em fase adulta), rodenticidas, inseticidas e larvicidas, que combatem insetos e larvas respectivamente, dentre outros. Logo após o controle químico, deverá ser feito o controle mecânico. Esse controle é feito usando equipamentos que deverão conter ou matar as pragas.\r\n\r\nMuitos equipamentos são conhecidos, como ratoeiras, papeis adesivos e armadilhas de captura. Podem ser usados aparelhos ultrassônicos e telas, que servirão para afastar esses animais ou impedir o seu acesso.\r\n\r\nFinalizando as etapas acima, serão tomadas agora as medidas preventivas e corretivas. Elas diferenciam-se pelo foco de sua atuação.\r\n\r\nAs ações preventivas visam impedir que as pragas ocorram ou voltem a ocorrer. Já as ações corretivas são basicamente a instalação de barreiras físicas, a fim de impedir sua entrada ou sua acomodação posterior, justamente naqueles locais onde foram identificadas falhas nas etapas anteriores.\r\n\r\nApós serem concluídas as etapas de medidas preventivas e corretivas deve ser feito, por último, o monitoramento. Todas as etapas anteriormente descritas deverão ser periodicamente checadas e reforçadas para que as chances de invasão por insetos e roedores sejam sempre reduzidas. Isso implica no monitoramento contínuo das infestações, e principalmente, o reforço para que ocorra a mudança dos hábitos prejudiciais ao controle.\r\n\r\nVeja também:	• Controle de Pragas em Restaurantes\r\n• Controle de Pragas em Hospitais	• Controle de Pragas Insetos Rasteiros, Voadores\r\n• Produtos Utilizados no Controle de Pragas	• Diferença entre