	(6115,'Ladeira Joias Personalizadas','09516185000166','(61) 3349-0188','https://vanialadeira.com.br/','A marca Vânia Ladeira surge como proposta bem definida no ramo da joalheria, apoiada na formação acadêmica de sua criadora em Artes Plásticas e nos cursos que fez nas áreas de design e da confecção de joias.\r\n\r\nA criação das peças e sua materialização em metais e pedras preciosas é um experimento de feitura única e exclusiva. Em cada peça a designer estabelece sofisticada associação entre o conhecimento e a sua interpretação da arte e técnica da joalheria. As joias expressam estreita e indispensável ressonância com a personalidade e desejos do cliente, seus valores e sentimentos.\r\n\r\nA criação de cada joia materializa uma ponte entre o clássico e o contemporâneo, história que ultrapassa o tempo e não se perde em modismos.','','','',' Asa Norte',3034,24,'179.242.23.26','N','(61) 3349-0188','','2020-03-30 18:17:29',NULL,NULL),
